j_437_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_440',
        'panel_3': 'j_442'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_437';

    /*
     * Nonvisual components
     */
    var datasources = [];

    /*
     * Events and handlers
     */
    j_437_beforeshow = function() {
        Appery.CurrentScreen = 'j_437';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_2F59_onLoad = j_437_onLoad = function() {
        screen_2F59_elementsExtraJS();

        j_437_deviceEvents();
        j_437_windowEvents();
        screen_2F59_elementsEvents();
    }

    // screen window events
    screen_2F59_windowEvents = j_437_windowEvents = function() {
        $('#j_437').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });

    }

    // device events
    j_437_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_2F59_elementsExtraJS = j_437_elementsExtraJS = function() {
        // screen (screen-2F59) extra code

    }

    // screen elements handler
    screen_2F59_elementsEvents = j_437_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_439 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    history.back();

                }
            },
        });

    }

    $("#j_437").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_437_beforeshow();
    });

    if (runBeforeShow) {
        j_437_beforeshow();
    } else {
        j_437_onLoad();
    }

}

