j_1537_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton1_2': 'j_1539',
        'mobilegrid_21': 'j_1541',
        'mobilegridcell_22': 'j_1542',
        'img': 'j_1543',
        'mobilegridcell_42': 'j_1544',
        'mobilegrid_48': 'j_1545',
        'mobilegridcell_49': 'j_1546',
        'link_title': 'j_1547',
        'mobilegridcell_54': 'j_1548',
        'description': 'j_1549',
        'mobilegridcell_55': 'j_1550',
        'pubDate': 'j_1551'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_1537';

    /*
     * Nonvisual components
     */
    var datasources = [];

    youtubeFeed = new Appery.DataSource(Youtube, {
        'onComplete': function(jqXHR, textStatus) {

            $t.refreshScreenFormElements("j_1537");
        },
        'onSuccess': function(data) {},
        'onError': function(jqXHR, textStatus, errorThrown) {},
        'responseMapping': [],
        'requestMapping': [{
            'PATH': ['start-index'],
            'ATTR': '1'
        }, {
            'PATH': ['max-results'],
            'ATTR': '5'
        }]
    });

    datasources.push(youtubeFeed);

    /*
     * Events and handlers
     */
    j_1537_beforeshow = function() {
        Appery.CurrentScreen = 'j_1537';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_60CF_onLoad = j_1537_onLoad = function() {
        screen_60CF_elementsExtraJS();
        try {
            youtubeFeed.execute({})
        } catch (ex) {
            console.log(ex.name + '  ' + ex.message);
            hideSpinner();
        };

        j_1537_deviceEvents();
        j_1537_windowEvents();
        screen_60CF_elementsEvents();
    }

    // screen window events
    screen_60CF_windowEvents = j_1537_windowEvents = function() {
        $('#j_1537').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });

    }

    // device events
    j_1537_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_60CF_elementsExtraJS = j_1537_elementsExtraJS = function() {
        // screen (screen-60CF) extra code

    }

    // screen elements handler
    screen_60CF_elementsEvents = j_1537_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_1538 [name="mobilebutton1_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('startScreen', {
                        reverse: false
                    });

                }
            },
        });

    }

    $("#j_1537").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_1537_beforeshow();
    });

    if (runBeforeShow) {
        j_1537_beforeshow();
    } else {
        j_1537_onLoad();
    }

}

