j_750_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilelabel1_2': 'j_753',
        'mobilelabel1_3': 'j_754'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_750';

    /*
     * Nonvisual components
     */
    var datasources = [];

    /*
     * Events and handlers
     */
    j_750_beforeshow = function() {
        Appery.CurrentScreen = 'j_750';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_1BCF_onLoad = j_750_onLoad = function() {
        screen_1BCF_elementsExtraJS();

        j_750_deviceEvents();
        j_750_windowEvents();
        screen_1BCF_elementsEvents();
    }

    // screen window events
    screen_1BCF_windowEvents = j_750_windowEvents = function() {
        $('#j_750').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });

    }

    // device events
    j_750_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_1BCF_elementsExtraJS = j_750_elementsExtraJS = function() {
        // screen (screen-1BCF) extra code

    }

    // screen elements handler
    screen_1BCF_elementsEvents = j_750_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

    }

    $("#j_750").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_750_beforeshow();
    });

    if (runBeforeShow) {
        j_750_beforeshow();
    } else {
        j_750_onLoad();
    }

}

