j_221_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton1_2': 'j_224',
        'mobilelist1_3': 'j_226',
        'mobilelistitem1_4': 'j_227',
        'mobilelistitembtn1_5': 'j_228',
        'mobilelistitem1_15': 'j_229',
        'title': 'j_231',
        'mobilelistitembtn1_16': 'j_232',
        'date': 'j_230',
        'mobilegrid_17': 'j_233',
        'mobilegridcell_18': 'j_234',
        'prevButton': 'j_235',
        'mobilegridcell_19': 'j_236',
        'panel_22': 'j_237',
        'mobilegridcell_21': 'j_238',
        'nextButton': 'j_239',
        'mobilenavbar_27': 'j_241',
        'mobilenavbaritem_28': 'j_242',
        'Notifications': 'j_243'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_221';

    /*
     * Nonvisual components
     */
    var datasources = [];

    eNewsFeed = new Appery.DataSource(eNewsServer, {
        'onComplete': function(jqXHR, textStatus) {

            $t.refreshScreenFormElements("j_221");
        },
        'onSuccess': function(data) {},
        'onError': function(jqXHR, textStatus, errorThrown) {},
        'responseMapping': [{
            'PATH': ['total', 'total'],
            'ID': '___local_storage___',
            'ATTR': 'eNewsTotal'
        }, {
            'PATH': ['entry'],
            'ID': 'mobilelistitem1_15',
            'SET': [{
                'PATH': ['title'],
                'ID': 'title',
                'ATTR': '@'
            }, {
                'PATH': ['pubdate'],
                'ID': 'date',
                'ATTR': '@',
                'TRANSFORMATION': function(value, element) {
                    return Helpers.parseNewsDate(value);
                }
            }]
        }],
        'requestMapping': [{
            'PATH': ['limit'],
            'ID': '___local_storage___',
            'ATTR': 'eNewsLimit'
        }, {
            'PATH': ['skip'],
            'ID': '___local_storage___',
            'ATTR': 'eNewsSkip'
        }]
    });

    datasources.push(eNewsFeed);

    checkNotes = new Appery.DataSource(Notification_list, {
        'onComplete': function(jqXHR, textStatus) {

            $t.refreshScreenFormElements("j_221");
        },
        'onSuccess': function(data) {},
        'onError': function(jqXHR, textStatus, errorThrown) {},
        'responseMapping': [{
            'PATH': ['total', 'total'],
            'ID': '___local_storage___',
            'ATTR': 'notificationNumber'
        }],
        'requestMapping': [{
            'PATH': ['k'],
            'ID': '___local_storage___',
            'ATTR': 'currentUserAuth'
        }]
    });

    datasources.push(checkNotes);

    /*
     * Events and handlers
     */
    j_221_beforeshow = function() {
        Appery.CurrentScreen = 'j_221';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_E463_onLoad = j_221_onLoad = function() {
        screen_E463_elementsExtraJS();
        try {
            eNewsFeed.execute({})
        } catch (ex) {
            console.log(ex.name + '  ' + ex.message);
            hideSpinner();
        };
        try {
            checkNotes.execute({})
        } catch (ex) {
            console.log(ex.name + '  ' + ex.message);
            hideSpinner();
        };

        $('.ui-listview').css('margin-top', '1px');

        var skip = parseInt(localStorage.getItem('eNewsSkip'));
        var limit = parseInt(localStorage.getItem('eNewsLimit'));
        var total = parseInt(localStorage.getItem('eNewsTotal'));

        if (skip == 0) {
            Tiggzi('prevButton').hide();
        }
        if (skip + limit >= total) {
            Tiggzi('nextButton').hide();
        }
        var start = skip + 1;
        var end = skip + limit;
        if (end > total) {
            end = total;
        };

        $('#position').html('Displaying<br/>' + start + ' - ' + end + ' of ' + total);

        $('.mobileFooter').css('min-height', '0px');
        $('.pagefooter').css('margin-bottom', '-3px');;
        var totalnotifications = parseInt(localStorage.getItem("notificationNumber"));
        var readnotifications = parseInt(localStorage.getItem("totalReadNotifications"));
        if (readnotifications) {
            if (readnotifications < totalnotifications) {
                var unread = totalnotifications - readnotifications;
            }
        } else {
            var unread = totalnotifications;
        }
        if (unread) {
            Appery('Notifications').children(".ui-btn-inner").append("<div style='float:right; position:absolute; top:5px; right:7px; background:#430000; padding:3px 5px 3px 5px; border:1px solid #F90; -webkit-border-radius:5px; border-radius:5px; -moz-border-radius:5px; '>" + unread + "</div>");
        };

        j_221_deviceEvents();
        j_221_windowEvents();
        screen_E463_elementsEvents();
    }

    // screen window events
    screen_E463_windowEvents = j_221_windowEvents = function() {
        $('#j_221').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });

    }

    // device events
    j_221_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_E463_elementsExtraJS = j_221_elementsExtraJS = function() {
        // screen (screen-E463) extra code

        /* mobilelist6 */

        listView = $("#j_226");
        theme = listView.attr("data-theme");
        if (typeof theme !== 'undefined') {
            var themeClass = "ui-btn-up-" + theme;
            listItem = $("#j_226 .ui-li-static");
            $.each(listItem, function(index, value) {
                $(this).addClass(themeClass);
            });
        }

        /* mobilelistitem1_4 */

        /* mobilelistitem1_15 */

    }

    // screen elements handler
    screen_E463_elementsEvents = j_221_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_223 [name="mobilebutton1_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('startScreen', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

        $('#j_225 [name="mobilelistitem1_15"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    setVar_('selectedArticle', 'j_231', 'text', '', this);
                    Appery.navigateTo('eNewsItem', {
                        transition: 'slide',
                        reverse: false
                    });

                }
            },
        });

        $('#j_225 [name="prevButton"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    var skip = parseInt(localStorage.getItem('eNewsSkip'));
                    var limit = parseInt(localStorage.getItem('eNewsLimit'));
                    var total = parseInt(localStorage.getItem('eNewsTotal'));

                    if (limit + skip > limit) {
                        localStorage.setItem('eNewsSkip', skip - limit);
                    }
                    Tiggzi.navigateTo(eNews);
                    window.location = 'eNews.html';

                }
            },
        });

        $('#j_225 [name="nextButton"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    var skip = parseInt(localStorage.getItem('eNewsSkip'));
                    var limit = parseInt(localStorage.getItem('eNewsLimit'));
                    var total = parseInt(localStorage.getItem('eNewsTotal'));

                    if (limit + skip < total) {
                        localStorage.setItem('eNewsSkip', limit + skip);
                    }
                    Tiggzi.navigateTo(eNews);
                    window.location = 'eNews.html';

                }
            },
        });

        $('#j_240 [name="Notifications"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('notificationsList', {
                        transition: 'slide',
                        reverse: false
                    });

                }
            },
        });

    }

    $("#j_221").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_221_beforeshow();
    });

    if (runBeforeShow) {
        j_221_beforeshow();
    } else {
        j_221_onLoad();
    }

}

