j_520_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_523',
        'panel_7': 'j_525',
        'mobilenavbar_3': 'j_527',
        'mobilenavbaritem_4': 'j_528',
        'mobilenavbaritem_5': 'j_529'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_520';

    /*
     * Nonvisual components
     */
    var datasources = [];

    /*
     * Events and handlers
     */
    j_520_beforeshow = function() {
        Appery.CurrentScreen = 'j_520';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_F952_onLoad = j_520_onLoad = function() {
        screen_F952_elementsExtraJS();
		
		$('.mobileFooter').css('min-height', '0px');

        j_520_deviceEvents();
        j_520_windowEvents();
        screen_F952_elementsEvents();
    }

    // screen window events
    screen_F952_windowEvents = j_520_windowEvents = function() {
        $('#j_520').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });
        $('#j_520').bind({
            pageshow: function() {

                $('.mobilegrid img').css('margin', 'auto');
                $('.ui-collapsible .ui-body-g').css('margin-top', '-3px');
                $('.ui-collapsible-heading-toggle').css('text-decoration', 'none');

                $('.ui-btn-up-g').css('height', '34px');
                $('.ui-icon-arrow-r').remove();

                $("#cupBoard").html('<div style="text-align:center; width:100%;" class="ui-icon-loading"></div>').load('http://m.convention2013.amsa.org.au/app/cupBoard.php');
            },
        });

    }

    // device events
    j_520_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_F952_elementsExtraJS = j_520_elementsExtraJS = function() {
        // screen (screen-F952) extra code

    }

    // screen elements handler
    screen_F952_elementsEvents = j_520_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_522 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    var uid = localStorage.getItem('currentUserId');
                    if (uid == "Guest") {
                        Tiggzi.navigateTo('guestScreen', {
                            transition: 'slide',
                            reverse: true
                        });
                    } else {
                        Tiggzi.navigateTo('startScreen', {
                            transition: 'slide',
                            reverse: true
                        });
                    };

                }
            },
        });

        $('#j_526 [name="mobilenavbaritem_4"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('ConventionCup', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

    }

    $("#j_520").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_520_beforeshow();
    });

    if (runBeforeShow) {
        j_520_beforeshow();
    } else {
        j_520_onLoad();
    }

}

