j_1510_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilegrid_16': 'j_1515',
        'mobilegridcell_17': 'j_1516',
        'mobilegridcell_18': 'j_1517',
        'mobileimage_12': 'j_1518',
        'mobilegridcell_21': 'j_1519',
        'loginField': 'j_1513',
        'passwordField': 'j_1514',
        'mobilegrid_36': 'j_1526',
        'mobilegridcell_37': 'j_1527',
        'mobilegridcell_38': 'j_1528',
        'mobilebutton1_23': 'j_1529',
        'mobilegridcell_41': 'j_1530',
        'mobilegridcell_42': 'j_1531',
        'mobilebutton1_15': 'j_1532',
        'mobilegridcell_43': 'j_1533',
        'mobilelabel_35': 'j_1525',
        'mobilebutton_44': 'j_1534',
        'mobilegrid_26': 'j_1520',
        'mobilegridcell_27': 'j_1521',
        'mobilegridcell_28': 'j_1522',
        'mobileimage_25': 'j_1523',
        'mobilegridcell_31': 'j_1524'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_1510';

    /*
     * Nonvisual components
     */
    var datasources = [];

    loginService = new Appery.DataSource(Delegates_login, {
        'onComplete': function(jqXHR, textStatus) {

            $t.refreshScreenFormElements("j_1510");
        },
        'onSuccess': function(data) {
            Appery.navigateTo('startScreen', {
                reverse: false
            });
        },
        'onError': function(jqXHR, textStatus, errorThrown) {
            alert("Login Failed - Invalid Email or Password");
        },
        'responseMapping': [{
            'PATH': ['user', 'user', 'user_id'],
            'ID': '___local_storage___',
            'ATTR': 'currentUserId'
        }, {
            'PATH': ['user', 'user', 'user_fullname'],
            'ID': '___local_storage___',
            'ATTR': 'currentUserName'
        }, {
            'PATH': ['user', 'user', 'user_email'],
            'ID': '___local_storage___',
            'ATTR': 'currentUserEmail'
        }, {
            'PATH': ['auth[0]', '.'],
            'ID': '___local_storage___',
            'ATTR': 'currentUserAuth'
        }],
        'requestMapping': [{
            'PATH': ['email'],
            'ID': 'loginField',
            'ATTR': 'value'
        }, {
            'PATH': ['pwd'],
            'ID': 'passwordField',
            'ATTR': 'value'
        }]
    });

    datasources.push(loginService);

    /*
     * Appery Push-notification registration service
     */
    var _registerPushApperyDS = new Appery.DataSource(_pushRegistrationApperyService, {
        'onComplete': function(jqXHR, textStatus) {
            $t.refreshScreenFormElements("j_1510");
        },
        'onSuccess': function(data) {
            console.info('App successful registered at Appery Push service');
            $(document).trigger('pushregistrationsuccess');
        },
        'onError': function(jqXHR, textStatus, errorThrown) {
            $(document).trigger('pushregistrationfail');
        },
        'responseMapping': [],
        'requestMapping': [{
            'PATH': ['type'],
            'TRANSFORMATION': function(value) {
                return Appery.getTargetPlatform();
            }
        }, {
            'PATH': ['guid'],
            'TRANSFORMATION': function(value) {
                return Appery.getProjectGUID();
            }
        }, {
            'PATH': ['token'],
            'ID': '___local_storage___',
            'ATTR': 'pushNotificationToken'
        }, {
            'PATH': ['deviceID'],
            'ID': '___local_storage___',
            'ATTR': 'pushNotificationDeviceID'
        }]
    });
    /*
     * Events and handlers
     */
    j_1510_beforeshow = function() {
        Appery.CurrentScreen = 'j_1510';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_34BA_onLoad = j_1510_onLoad = function() {
        screen_34BA_elementsExtraJS();

        j_1510_deviceEvents();
        j_1510_windowEvents();
        screen_34BA_elementsEvents();
    }

    // screen window events
    screen_34BA_windowEvents = j_1510_windowEvents = function() {
        $('#j_1510').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });
        $('#j_1510').bind({
            pageshow: function() {
                if (localStorage.getItem("currentUserId")) {
                    var UserName = localStorage.getItem("currentUserName");
                    var UserID = localStorage.getItem("currentUserId");

                    if (UserID == "Guest") {} else {
                        Tiggzi.navigateTo("startScreen");
                    }
                };
            },
        });

    }

    // device events
    j_1510_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

            $(document).bind("pushinit", function() {
                localStorage.setItem('pushNotificationToken', arguments[1].deviceToken);
                _registerPushApperyDS.execute({});
            });
            var pushNotification = window.plugins.pushNotification;
            pushNotification.getDeviceUniqueIdentifier(function(status) {
                localStorage.setItem('pushNotificationDeviceID', status);
            });
            pushNotification.registerDevice({
                alert: true,
                badge: true,
                sound: true,
                senderid: '901855172104'
            }, function(status) {
                $(document).trigger('pushinit', status);
            });
        });
    }

    // screen elements extra js
    screen_34BA_elementsExtraJS = j_1510_elementsExtraJS = function() {
        // screen (screen-34BA) extra code

    }

    // screen elements handler
    screen_34BA_elementsEvents = j_1510_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_1512 [name="mobilebutton1_23"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    localStorage.setItem("currentUserName", "Guest");
                    localStorage.setItem("currentUserId", "Guest");
                    Appery.navigateTo('guestScreen', {
                        reverse: false
                    });

                }
            },
        });

        $('#j_1512 [name="mobilebutton1_15"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    try {
                        loginService.execute({})
                    } catch (ex) {
                        console.log(ex.name + '  ' + ex.message);
                        hideSpinner();
                    };

                }
            },
        });

        $('#j_1512 [name="mobilelabel_35"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('resendDetails', {
                        transition: 'slide',
                        reverse: false
                    });

                }
            },
        });
        $('#j_1512 [name="mobilebutton_44"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('resendDetails', {
                        transition: 'slide',
                        reverse: false
                    });

                }
            },
        });

    }

    $("#j_1510").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_1510_beforeshow();
    });

    if (runBeforeShow) {
        j_1510_beforeshow();
    } else {
        j_1510_onLoad();
    }

}

$("#j_1510").die("pageinit").live("pageinit", function(event, ui) {
    Appery.processSelectMenu($(this));
    j_1510_js();
});






