    /*
     * Nonvisual components
     */
    var datasources = [];

    /*
     * Events and handlers
     */
    j_1502_beforeshow = function() {
        Appery.CurrentScreen = 'j_1502';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_77E0_onLoad = j_1502_onLoad = function() {
        screen_77E0_elementsExtraJS();

        j_1502_deviceEvents();
        j_1502_windowEvents();
        screen_77E0_elementsEvents();
    }

    // screen window events
    screen_77E0_windowEvents = j_1502_windowEvents = function() {
        $('#j_1502').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });
        $('#j_1502').bind({
            pageshow: function() {
                $("#bumpres").html('<div style="text-align:center; width:100%;" class="ui-icon-loading"></div>').load('http://m.convention2013.amsa.org.au/app/bump/bumpProcess.php');
            },
        });

    }

