j_185_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_188',
        'panel_3': 'j_190'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_185';

    /*
     * Nonvisual components
     */
    var datasources = [];

    /*
     * Events and handlers
     */
    j_185_beforeshow = function() {
        Appery.CurrentScreen = 'j_185';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_12EA_onLoad = j_185_onLoad = function() {
        screen_12EA_elementsExtraJS();

        j_185_deviceEvents();
        j_185_windowEvents();
        screen_12EA_elementsEvents();
    }

    // screen window events
    screen_12EA_windowEvents = j_185_windowEvents = function() {
        $('#j_185').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });
        $('#j_185').bind({
            pageshow: function() {
                $("#paird").html('<div style="text-align:center; width:100%;" class="ui-icon-loading"></div>').load('http://m.convention2013.amsa.org.au/app/pair.php');
            },
        });

    }

    // device events
    j_185_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_12EA_elementsExtraJS = j_185_elementsExtraJS = function() {
        // screen (screen-12EA) extra code

    }

    // screen elements handler
    screen_12EA_elementsEvents = j_185_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_187 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('startScreen', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

    }

    $("#j_185").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_185_beforeshow();
    });

    if (runBeforeShow) {
        j_185_beforeshow();
    } else {
        j_185_onLoad();
    }

}

