j_590_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_593',
        'panel_3': 'j_595',
        'panel_4': 'j_596',
        'mobilenavbar_5': 'j_598',
        'mobilenavbaritem_6': 'j_599',
        'mobilenavbaritem_7': 'j_600'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_590';

    /*
     * Nonvisual components
     */
    var datasources = [];

    /*
     * Events and handlers
     */
    j_590_beforeshow = function() {
        Appery.CurrentScreen = 'j_590';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_7341_onLoad = j_590_onLoad = function() {
        screen_7341_elementsExtraJS();
		
		$('.mobileFooter').css('min-height', '0px');

        j_590_deviceEvents();
        j_590_windowEvents();
        screen_7341_elementsEvents();
    }

    // screen window events
    screen_7341_windowEvents = j_590_windowEvents = function() {
        $('#j_590').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });

    }

    // device events
    j_590_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_7341_elementsExtraJS = j_590_elementsExtraJS = function() {
        // screen (screen-7341) extra code

    }

    // screen elements handler
    screen_7341_elementsEvents = j_590_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_592 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('startScreen', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

        $('#j_597 [name="mobilenavbaritem_7"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('SpeakerList', {
                        transition: 'slide',
                        reverse: false
                    });

                }
            },
        });

    }

    $("#j_590").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_590_beforeshow();
    });

    if (runBeforeShow) {
        j_590_beforeshow();
    } else {
        j_590_onLoad();
    }

}

