$(document).delegate('[data-role="page"]', 'pageshow', function()
{
    if ($.mobile.activePage.find('.menuwrapper').length > 0)
    {
        if (this.id in myScroll)
        {
            myScroll[this.id].refresh();
        }
        else
        {
            myScroll[this.id] = new iScroll($.mobile.activePage.find('.menuwrapper')[0].id, {
                hScroll: true,
                vScroll: false,
                hScrollbar: false
            });
        }
    }
});

$(window).bind('orientationchange', function()
{
    if ($.mobile.activePage[0].id in myScroll)
    {
        myScroll[$.mobile.activePage[0].id].refresh();
    }
});
                    

