j_68_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_71',
        'mobilelabel_4': 'j_73',
        'mobiletextinput_5': 'j_74',
        'mobilebutton_6': 'j_75',
        'panel_7': 'j_76'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_68';

    /*
     * Nonvisual components
     */
    var datasources = [];

    /*
     * Events and handlers
     */
    j_68_beforeshow = function() {
        Appery.CurrentScreen = 'j_68';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_3B75_onLoad = j_68_onLoad = function() {
        screen_3B75_elementsExtraJS();


        j_68_deviceEvents();
        j_68_windowEvents();
        screen_3B75_elementsEvents();
    }

    // screen window events
    screen_3B75_windowEvents = j_68_windowEvents = function() {
        $('#j_68').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });

    }

    // device events
    j_68_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_3B75_elementsExtraJS = j_68_elementsExtraJS = function() {
        // screen (screen-3B75) extra code

    }

    // screen elements handler
    screen_3B75_elementsEvents = j_68_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_70 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('LoginPage', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

        $('#j_72 [name="mobilebutton_6"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    var id = $(".emailid").val();

                    $("#display").html('<center>Processing...</center>');

                    $.ajax({
                        type: "POST",
                        data: {
                            id: id
                        },
                        url: 'http://m.convention2013.amsa.org.au/app/resenddetails.php',
                        success: function(data) {
                            $("#display").html(data);
                        }
                    });

                }
            },
        });

    }

    $("#j_68").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_68_beforeshow();
    });

    if (runBeforeShow) {
        j_68_beforeshow();
    } else {
        j_68_onLoad();
    }

}

