j_737_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_740',
        'panel_7': 'j_746',
        'mobilebutton_3': 'j_742',
        'panel_6': 'j_743',
        'scanText': 'j_744',
        'mobilebutton_5': 'j_745'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_737';

    /*
     * Nonvisual components
     */
    var datasources = [];

    codeScanner = new Appery.DataSource(BarcodeService, {
        'onComplete': function(jqXHR, textStatus) {

            $t.refreshScreenFormElements("j_737");
        },
        'onSuccess': function(data) {},
        'onError': function(jqXHR, textStatus, errorThrown) {
            alert("Error: Scan Failed");
        },
        'responseMapping': [{
            'PATH': ['text'],
            'ID': 'scanText',
            'ATTR': '@'
        }, {
            'PATH': ['text'],
            'ID': '___local_storage___',
            'ATTR': 'codeUrl',
            'TRANSFORMATION': function(value, element) {
                $('.scanresultsbox').css('display', 'block');
                var scanres = value;

                if (scanres.toLowerCase().indexOf("http") >= 0) {
                    $('.loadbutton').css('visibility', 'visible');
                }
            }
        }, {
            'PATH': ['text'],
            'ID': '___js___',
            'ATTR': 'codeurl'
        }],
        'requestMapping': []
    });

    datasources.push(codeScanner);

    /*
     * Events and handlers
     */
    j_737_beforeshow = function() {
        Appery.CurrentScreen = 'j_737';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_FB4D_onLoad = j_737_onLoad = function() {
        screen_FB4D_elementsExtraJS();

        j_737_deviceEvents();
        j_737_windowEvents();
        screen_FB4D_elementsEvents();
    }

    // screen window events
    screen_FB4D_windowEvents = j_737_windowEvents = function() {
        $('#j_737').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });
        $('#j_737').bind({
            pageshow: function() {
                $("#scannertextdiv").html('').load('http://m.convention2013.amsa.org.au/app/scanner.php');
                $('.scanresultsbox').css('display', 'none');;
            },
        });

    }

    // device events
    j_737_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_FB4D_elementsExtraJS = j_737_elementsExtraJS = function() {
        // screen (screen-FB4D) extra code

    }

    // screen elements handler
    screen_FB4D_elementsEvents = j_737_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_739 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('startScreen', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

        $('#j_741 [name="mobilebutton_3"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    try {
                        codeScanner.execute({})
                    } catch (ex) {
                        console.log(ex.name + '  ' + ex.message);
                        hideSpinner();
                    };

                }
            },
        });

        $('#j_741 [name="mobilebutton_5"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    var codeurl = localStorage.getItem("codeUrl");
                    var cb = window.plugins.childBrowser;
                    cb.showWebPage(codeurl, {
                        showAddress: false
                    });;

                }
            },
        });

    }

    $("#j_737").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_737_beforeshow();
    });

    if (runBeforeShow) {
        j_737_beforeshow();
    } else {
        j_737_onLoad();
    }

}

$("#j_737").die("pageinit").live("pageinit", function(event, ui) {
    Appery.processSelectMenu($(this));
    j_737_js();
});

