    // screen elements handler
    screen_C3EA_elementsEvents = j_79_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_80 [name="mobilebutton1_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    history.back();

                }
            },
        });

    }

    $("#j_79").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_79_beforeshow();
    });

