                    var selectedLog = localStorage.getItem("selectedLogistics");
if (selectedLog == "welfare")
{
    $('#logisticsheader').html('Welfare');
    $('#logisticsinfo').html('Welfare Officers will be present at every social event, poised to save delegates whose lives are in peril, who no longer possess the ability to walk, are bleeding from all officers, or who need a shoulder on which to cry. Don’t be embarrassed about how you got yourself into such a mess! Our Welfare Officers are past convention attendees and have been there before.<br/><br/>Look out for these guardian medics in the red welfare t­-shirts and make a note of the signage pointing to the designated Welfare Area each night.<br/><br/><center><span style="font-size:14px;font-weight:bold;">04 8888 4213</span><br/><span style="font-size:12px;font-weight:bold;">Welfare phone</span></center><br/>Please remember to put this number somewhere safe. You can also remember it as ‘04 8888 GC13’. Store it in your phone or write it someplace on a friend that doesn’t often get washed. This number is an emergency line so only call if you NEED a Welfare Officer, not if you can’t fnd a cab, or if you’ve lost your camera. As always, if the emergency warrants an ambulance, dial 000.');
}
if (selectedLog == "lostproperty")
{
    $('#logisticsheader').html('Lost Property');
    $('#logisticsinfo').html('If you have lost or found a belonging, please swing by the GCCEC Rego Desk. The desk will be open every day during morning tea.');
}
if (selectedLog == "socialnights")
{
    $('#logisticsheader').html('Social Nights');
    $('#logisticsinfo').html('Lockout for each social night is 9pm. Make sure to arrive by this time to be let in!<br/><br/>Remember to bring your current ID e.g. driver’s license (not uni ID) to all social events.');
}
if (selectedLog == "gps")
{
    $('#logisticsheader').html('General Practitioners');
    $('#logisticsinfo').html('Caught a case of the infamous Conventionitis? Call one of our GPs who are located a short walk from the accommodation venues.<br/><br/>Both are bulk billing for healthcare card holders.<br/><br/><strong>Oasis Medical Centre</strong><br/>Suite 209 Level 2 <br/>The Oasis Shopping Centre<br/>Victoria Avenue Broadbeach<br/>Telephone (07) 5504 7488<br/><br/><strong>Broadbeach Medical Practice</strong> <br/>Shop 1E-13, Oracle East <br/>6 Charles Ave Broadbeach<br/>Telephone 5539 8583<br/>');
}
if (selectedLog == "buses")
{
    $('#logisticsheader').html('Buses');
    $('#logisticsinfo').html('Buses are an integral part of the Convention Social and Sports Day programs. The pickup zones will be:<br/><ul><li>Outside Air on Broadbeach</li><li>Across the road from Mantra</li></ul><br/>See the map of the Gold Coast for visualisation purposes. Please see individual event pages for bus times.<br/><br/>Delegates are expected to treat both the bus drivers and buses with respect. Any delegate found to have damaged buses will be responsible for repairs and/or cleaning.<br/><br/>If you miss the Bus to or from a venue, it will be up to you to find your own way back to your accommodation. Not to worry, however - we will be giving delegates ample warning before the last bus leaves to and from each venue.');
}
if (selectedLog == "taxis")
{
    $('#logisticsheader').html('Taxis');
    $('#logisticsinfo').html('Missed the last bus home? Call yourself a cab:<br/><br/><center><span style="font-size:14px;font-weight:bold;">131 008</span><br/><span style="font-size:12px;font-weight:bold;">Gold Coast Cabs</span></center>');
}
if (selectedLog == "alcohol")
{
    $('#logisticsheader').html('AMSAs Alcohol Policy');
    $('#logisticsinfo').html('From AMSA Regulations and By-laws<br/><br/>Events should be organised in a way which discourages dangerous levels of alcohol consumption.<br/><br/>At all events where alcohol is to be consumed: <br/><br/><ul><li>Non-­alcoholic beverages must be cheaper and as readily available as alcoholic beverages.</li><li>Reasonable quantities of food and free water must be readily available.</li><li>Alcoholic beverages should be provided in quantities which enable ‘standard drinks’ to be easily calculated, so attendees can monitor their alcohol intake;</li><li>Organisers should consider known co­morbid factors associated with alcohol consumption such as drink­ driving and unsafe sex, and should consider methods of preventing these.</li><li>As far as possible, events should not be structured such that attendees who do not wish to drink alcohol subsidise the cost of alcohol for other attendees.</li><li>In the light of the additional costs borne by delegates who intend to consume alcohol at GC2013 social events, the GC2013 Convention Organising Committee intends to ensure that those who have not paid the additional charge do not subsequently utilise the bar tabs provided for delegates. This is to ensure fairness to those delegates who have purchased drink packages.</li><li>Delegates who have purchased drink packages will be issued with tokens upon entry to the social venue. Delegates who have not purchased the drink package will not be issued with tokens.</li><li>Any delegate who has not purchased a drink package and is found to be utilising the bar tab at the social venue, will have their eligibility to attend future social events reviewed by the GC2013 Convention Organising Committee.</li></ul><br/>Delegates who have not purchased a drink package may purchase drinks from the social venue at normal bar prices.');
}
if (selectedLog == "behaviour")
{
    $('#logisticsheader').html('Delegate Behaviour');
    $('#logisticsinfo').html('<center><strong>At Accommodation Venues</strong></center><br/>All our hotels have a ‘No Party and No Excessive Noise’ policy, which will be STRICTLY ENFORCED. Any person(s) found to be creating excessive noise, having a party in their apartments or exceeding the number of permitted guests, will be evicted without refund. There will be no warning given.<br/><br/>Rooms must be maintained in an acceptable state. Delegates must not refuse any reasonable request made by staff for access to the rooms for cleaning or other purposes. ­Failure to do so will prompt a review of stated delegate’s accommodation and/or Convention registration.<br/><br/>Rooms are for the use of intended patrons only. Rooms must not be utilised by delegates whose registration does not include accommodation. Breaches of this will prompt a review of accommodation and/or Convention registration of all parties involved.<br/><br/>All visitors are required to vacate the building by eleven pm. Only the registered overnight guests up to the maximum rooming confguration are permitted to be in the apartments after this time.<br/><br/>All of our hotel rooms are non­smoking. Convention is a non­-smoking event.<br/><br/>In the event that the delegate fails to pay on demand any amount owing to Air on Broadbeach, Mantra Grand Sierra or Ultra Broadbeach pursuant to the booking and accommodation (including without limitation those incidentals such as telephone, cleaning, etc.), these hotels reserve the right to deny access and ask that they vacate the premises.<br/><br/>If in the event that a delegate has caused damage to the property or affected other guests/occupants of the property, the affected hotel reserves the right to ask that delegate and other guests in their room to leave and forfeit any monies paid and the delegate will be required to pay for any damage caused.<br/><br/>If delegate/occupant behaves in an unacceptable or aggressive manner to other guests/occupants or security staff or is suspected of carrying out illegal acts on the premises, that delegate/occupant will be asked to leave and the appropriate authorities will be notifed. All monies paid will be forfeited.<br/><br/><br/><center><strong>Within Public Places</strong></center><br/>(GCCEC,  Mantra Sierra Grand Hotel, Air on Broadbeach, Ultra Broadbeach corridors, elevators, lobbies, entrance foyers, bus waiting bays, footpaths, roads etc.)<br/><br/>Delegates must be respectful of other hotel guests/occupants. This includes when entering and exiting the venue. Failure to do so will prompt a review of stated delegate’s accommodation and/or Convention registration.<br/><br/>Noise levels are to be kept below what is considered ‘reasonable’ for that time of day/ night. ‘Reasonable’ is to be defned by the GC2013 Convention Committee, AMSA Executive and hotel staff. Breaches will prompt a review of stated delegate’s accommodation and/or Convention registration.<br/><br/>No alcohol is to be consumed within public places. Failure to comply with this may result in non­-admission to academic sessions, buses, and social nights.<br/><br/>Revealing costumes must be appropriately covered. Failure to comply with this may result in non­-admission to buses and social functions.');
}
                    

