j_20_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton1_4': 'j_23',
        'mobilebutton1_7': 'j_25',
        'googlemap1_5': 'j_24'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_20';

    /*
     * Nonvisual components
     */
    var datasources = [];

    geolocation1 = new Appery.DataSource(GeolocationService, {
        'onComplete': function(jqXHR, textStatus) {

            $t.refreshScreenFormElements("j_20");
        },
        'onSuccess': function(data) {
            var map = Tiggzi('googlemap1');
            map.options['address'] = '';
            map.refresh();
        },
        'onError': function(jqXHR, textStatus, errorThrown) {},
        'responseMapping': [{
            'PATH': ['coords', 'latitude'],
            'ID': 'googlemap1_5',
            'ATTR': 'latitude'
        }, {
            'PATH': ['coords', 'longitude'],
            'ID': 'googlemap1_5',
            'ATTR': 'longitude'
        }],
        'requestMapping': [{
            'PATH': ['options', 'maximumAge'],
            'ATTR': '3000'
        }, {
            'PATH': ['options', 'timeout'],
            'ATTR': '5000'
        }, {
            'PATH': ['options', 'enableHighAccuracy'],
            'ATTR': 'true'
        }, {
            'PATH': ['options', 'watchPosition'],
            'ATTR': 'false'
        }]
    });

    datasources.push(geolocation1);

    /*
     * Events and handlers
     */
    j_20_beforeshow = function() {
        Appery.CurrentScreen = 'j_20';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_789F_onLoad = j_20_onLoad = function() {
        screen_789F_elementsExtraJS();

        j_20_deviceEvents();
        j_20_windowEvents();
        screen_789F_elementsEvents();
    }

    // screen window events
    screen_789F_windowEvents = j_20_windowEvents = function() {
        $('#j_20').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });

    }

    // device events
    j_20_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_789F_elementsExtraJS = j_20_elementsExtraJS = function() {
        // screen (screen-789F) extra code

        /* googlemap1_5 */

        $("[name = 'googlemap1_5']").wrap("<div/>");
        $("[name = 'googlemap1_5']").parent().css("margin-left", $("[name = 'googlemap1_5']").css("margin-left"));
        $("[name = 'googlemap1_5']").parent().css("margin-right", $("[name = 'googlemap1_5']").css("margin-right"));

        var googlemap1_5_options = {
            markerSourceName: "googlemap1_5_markers",
            latitude: "",
            longitude: "",
            address: "",
            zoom: 10,
            showLocationMarker: false
        }

        Appery.__registerComponent('googlemap1_5', new Appery.TiggziMapComponent("googlemap1_5", googlemap1_5_options));
        $("[name='googlemap1_5']").closest("[data-role='page']").bind({
            pageshow: function() {
                if (Appery('googlemap1_5') != undefined) {
                    Appery('googlemap1_5').refresh();
                }
            }
        });

    }

    // screen elements handler
    screen_789F_elementsEvents = j_20_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_22 [name="mobilebutton1_4"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    var myOptions = {
                        zoom: 8,
                        center: new google.maps.LatLng(37.63, -122.424),
                        mapTypeId: google.maps.MapTypeId.ROADMAP
                    };

                    var map = new google.maps.Map($('div[dsid="googlemap1_5"]').get(0), myOptions);

                    //San Francisco, with custom marker
                    var sfLatlng = new google.maps.LatLng(37.775, -122.4183333);
                    var marker = new google.maps.Marker({
                        position: sfLatlng,
                        map: map,
                        title: "San Francisco",
                        icon: "http://i.imgur.com/QtWkT.png"
                    });

                    //San Jose
                    var sjLatlng = new google.maps.LatLng(37.3394444, -121.8938889);
                    var marker = new google.maps.Marker({
                        position: sjLatlng,
                        map: map,
                        title: "San Jose"
                    });

                    //San Mateo
                    var smLatlng = new google.maps.LatLng(37.5630556, -122.3244444);
                    var marker = new google.maps.Marker({
                        position: smLatlng,
                        map: map,
                        title: "San Meteo"
                    });

                }
            },
        });
        $('#j_22 [name="mobilebutton1_7"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    var map = Tiggzi('map');
                    map.options['address'] = '';
                    map.refresh();

                }
            },
        });

    }

    $("#j_20").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_20_beforeshow();
    });

    if (runBeforeShow) {
        j_20_beforeshow();
    } else {
        j_20_onLoad();
    }

}

