j_473_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_476',
        'panel_3': 'j_478'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_473';

    /*
     * Nonvisual components
     */
    var datasources = [];

    checkstatus = new Appery.DataSource(bumpcheck, {
        'onComplete': function(jqXHR, textStatus) {

            $t.refreshScreenFormElements("j_473");
        },
        'onSuccess': function(data) {},
        'onError': function(jqXHR, textStatus, errorThrown) {
            alert("Unable to connect to service");
            Tiggzi.navigateTo("Pair", {
                transition: 'slide',
                reverse: true
            });
        },
        'responseMapping': [{
            'PATH': ['result'],
            'ID': '___local_storage___',
            'ATTR': 'bumpstatus',
            'TRANSFORMATION': function(value, element) {
                var status = value;
                if (status == 1) {} else {
                    alert(status);
                    Tiggzi.navigateTo("Pair", {
                        transition: 'slide',
                        reverse: true
                    });
                }
            }
        }],
        'requestMapping': []
    });

    datasources.push(checkstatus);

    /*
     * Events and handlers
     */
    j_473_beforeshow = function() {
        Appery.CurrentScreen = 'j_473';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_DB31_onLoad = j_473_onLoad = function() {
        screen_DB31_elementsExtraJS();

        j_473_deviceEvents();
        j_473_windowEvents();
        screen_DB31_elementsEvents();
    }

    // screen window events
    screen_DB31_windowEvents = j_473_windowEvents = function() {
        $('#j_473').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });
        $('#j_473').bind({
            pageshow: function() {
                try {
                    checkstatus.execute({})
                } catch (ex) {
                    console.log(ex.name + '  ' + ex.message);
                    hideSpinner();
                };
                $("#bumppagediv").html('<div style="text-align:center; width:100%;" class="ui-icon-loading"></div>').load('http://m.convention2013.amsa.org.au/app/bump/bumpdiv.php');
            },
        });

    }

    // device events
    j_473_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_DB31_elementsExtraJS = j_473_elementsExtraJS = function() {
        // screen (screen-DB31) extra code

    }

    // screen elements handler
    screen_DB31_elementsEvents = j_473_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_475 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('Pair', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

    }

    $("#j_473").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_473_beforeshow();
    });

    if (runBeforeShow) {
        j_473_beforeshow();
    } else {
        j_473_onLoad();
    }

}

