j_352_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_355',
        'mobilelist_3': 'j_357',
        'mobilelistitem_4': 'j_358',
        'mobilelistitembutton_5': 'j_359',
        'mobilelistitem_6': 'j_360',
        'mobilelistitembutton_7': 'j_361',
        'catname': 'j_362',
        'desc': 'j_364',
        'catid': 'j_363',
        'mobilenavbar_12': 'j_366',
        'mobilenavbaritem_13': 'j_367',
        'mobilenavbaritem_14': 'j_368'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_352';

    /*
     * Nonvisual components
     */
    var datasources = [];

    grabdeals = new Appery.DataSource(DealCategories, {
        'onComplete': function(jqXHR, textStatus) {

            $t.refreshScreenFormElements("j_352");
        },
        'onSuccess': function(data) {},
        'onError': function(jqXHR, textStatus, errorThrown) {},
        'responseMapping': [{
            'PATH': ['$'],
            'ID': 'mobilelistitem_6',
            'SET': [{
                'PATH': ['id'],
                'ID': 'catid',
                'ATTR': '@'
            }, {
                'PATH': ['name'],
                'ID': 'catname',
                'ATTR': '@'
            }, {
                'PATH': ['desc'],
                'ID': 'desc',
                'ATTR': '@'
            }]
        }],
        'requestMapping': []
    });

    datasources.push(grabdeals);

    /*
     * Events and handlers
     */
    j_352_beforeshow = function() {
        Appery.CurrentScreen = 'j_352';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_725F_onLoad = j_352_onLoad = function() {
        screen_725F_elementsExtraJS();
        $('.ui-listview-filter').css('margin-left', '0px');
        $('.ui-listview-filter').css('margin-right', '0px');
		$('.mobileFooter').css('min-height', '0px');

        j_352_deviceEvents();
        j_352_windowEvents();
        screen_725F_elementsEvents();
    }

    // screen window events
    screen_725F_windowEvents = j_352_windowEvents = function() {
        $('#j_352').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });
        $('#j_352').bind({
            pageshow: function() {
                try {
                    grabdeals.execute({})
                } catch (ex) {
                    console.log(ex.name + '  ' + ex.message);
                    hideSpinner();
                };
            },
        });

    }

    // device events
    j_352_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_725F_elementsExtraJS = j_352_elementsExtraJS = function() {
        // screen (screen-725F) extra code

        /* mobilelist9 */

        listView = $("#j_357");
        theme = listView.attr("data-theme");
        if (typeof theme !== 'undefined') {
            var themeClass = "ui-btn-up-" + theme;
            listItem = $("#j_357 .ui-li-static");
            $.each(listItem, function(index, value) {
                $(this).addClass(themeClass);
            });
        }

        /* mobilelistitem_4 */

        /* mobilelistitem_6 */

    }

    // screen elements handler
    screen_725F_elementsEvents = j_352_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_354 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    var uid = localStorage.getItem('currentUserId');
                    if (uid == "Guest") {
                        Tiggzi.navigateTo('guestScreen', {
                            transition: 'slide',
                            reverse: true
                        });
                    } else {
                        Tiggzi.navigateTo('startScreen', {
                            transition: 'slide',
                            reverse: true
                        });
                    };

                }
            },
        });

        $('#j_356 [name="mobilelistitem_6"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    setVar_('dealcatid', 'j_363', 'text', '', this);
                    setVar_('dealcatname', 'j_362', 'text', '', this);
                    Appery.navigateTo('MapsDealList', {
                        transition: 'slide',
                        reverse: false
                    });

                }
            },
        });

        $('#j_365 [name="mobilenavbaritem_13"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('Maps', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

    }

    $("#j_352").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_352_beforeshow();
    });

    if (runBeforeShow) {
        j_352_beforeshow();
    } else {
        j_352_onLoad();
    }

}

