j_8_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_11',
        'panel_3': 'j_13',
        'panel_4': 'j_14',
        'mobilenavbar_5': 'j_16',
        'mobilenavbaritem_6': 'j_17',
        'mobilenavbaritem_7': 'j_18'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_8';

    /*
     * Nonvisual components
     */
    var datasources = [];

    /*
     * Events and handlers
     */
    j_8_beforeshow = function() {
        Appery.CurrentScreen = 'j_8';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_F55E_onLoad = j_8_onLoad = function() {
        screen_F55E_elementsExtraJS();
		
		$('.mobileFooter').css('min-height', '0px');

        j_8_deviceEvents();
        j_8_windowEvents();
        screen_F55E_elementsEvents();
    }

    // screen window events
    screen_F55E_windowEvents = j_8_windowEvents = function() {
        $('#j_8').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });

    }

    // device events
    j_8_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_F55E_elementsExtraJS = j_8_elementsExtraJS = function() {
        // screen (screen-F55E) extra code

    }

    // screen elements handler
    screen_F55E_elementsEvents = j_8_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_10 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('startScreen', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

        $('#j_15 [name="mobilenavbaritem_7"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('SpeakerList', {
                        transition: 'slide',
                        reverse: false
                    });

                }
            },
        });

    }

    $("#j_8").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_8_beforeshow();
    });

    if (runBeforeShow) {
        j_8_beforeshow();
    } else {
        j_8_onLoad();
    }

}

