j_500_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_503',
        'mobilebutton_13': 'j_504',
        'mobilelist_3': 'j_506',
        'title': 'j_507',
        'mobilelistitembutton_5': 'j_508',
        'mobilelistitem_6': 'j_509',
        'mobilelistitembutton_7': 'j_510',
        'mobilegrid_10': 'j_511',
        'mobilegridcell_11': 'j_512',
        'number': 'j_513',
        'mobilegridcell_12': 'j_514',
        'questionid': 'j_516',
        'question': 'j_515'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_500';

    /*
     * Nonvisual components
     */
    var datasources = [];

    grabquestions = new Appery.DataSource(feedbackSession, {
        'onComplete': function(jqXHR, textStatus) {

            $t.refreshScreenFormElements("j_500");
        },
        'onSuccess': function(data) {},
        'onError': function(jqXHR, textStatus, errorThrown) {
            alert('Error - unable to retrieve questions.');
        },
        'responseMapping': [{
            'PATH': ['entry'],
            'ID': 'mobilelistitem_6',
            'SET': [{
                'PATH': ['id'],
                'ID': 'questionid',
                'ATTR': '@'
            }, {
                'PATH': ['num'],
                'ID': 'number',
                'ATTR': '@',
                'TRANSFORMATION': function(value, element) {
                    var numb = value + '.';
                    return numb;
                }
            }, {
                'PATH': ['question'],
                'ID': 'question',
                'ATTR': '@'
            }]
        }],
        'requestMapping': [{
            'PATH': ['sessid'],
            'ID': '___local_storage___',
            'ATTR': 'sessid'
        }]
    });

    datasources.push(grabquestions);

    /*
     * Events and handlers
     */
    j_500_beforeshow = function() {
        Appery.CurrentScreen = 'j_500';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_B3E0_onLoad = j_500_onLoad = function() {
        screen_B3E0_elementsExtraJS();

        j_500_deviceEvents();
        j_500_windowEvents();
        screen_B3E0_elementsEvents();
    }

    // screen window events
    screen_B3E0_windowEvents = j_500_windowEvents = function() {
        $('#j_500').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });
        $('#j_500').bind({
            pageshow: function() {
                try {
                    grabquestions.execute({})
                } catch (ex) {
                    console.log(ex.name + '  ' + ex.message);
                    hideSpinner();
                };
            },
        });

    }

    // device events
    j_500_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_B3E0_elementsExtraJS = j_500_elementsExtraJS = function() {
        // screen (screen-B3E0) extra code

        /* mobilelist11 */

        listView = $("#j_506");
        theme = listView.attr("data-theme");
        if (typeof theme !== 'undefined') {
            var themeClass = "ui-btn-up-" + theme;
            listItem = $("#j_506 .ui-li-static");
            $.each(listItem, function(index, value) {
                $(this).addClass(themeClass);
            });
        }

        /* title */

        /* mobilelistitem_6 */

    }

    // screen elements handler
    screen_B3E0_elementsEvents = j_500_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_502 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('Interact', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });
        $('#j_502 [name="mobilebutton_13"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    
                    Appery.navigateTo('FeedbackSession');

                }
            },
        });

        $('#j_505 [name="mobilelistitem_6"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    setVar_('questionid', 'j_516', 'text', '', this);
                    Appery.navigateTo('FeedbackQuestion', {
                        transition: 'slide',
                        reverse: false
                    });

                }
            },
        });

    }

    $("#j_500").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_500_beforeshow();
    });

    if (runBeforeShow) {
        j_500_beforeshow();
    } else {
        j_500_onLoad();
    }

}

