                    var selectedModule = localStorage.getItem("selectedModule");
if (selectedModule == "oconnor")
{
    $('#moduleTitle').html('<strong>Simon O’Connor</strong><br/>Things They Don’t Tell You In Medical School<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues1.jpg" style="width:155px;" /></center>Simon O’Connor works as an interventional cardiologist at the Canberra Hospital. His physician and cardiology training was at The Prince of Wales and Royal North Shore Hospitals in Sydney and at the Royal Canberra Hospital. He is also a member of the National Examiners’ panel of the Royal Australasian College of Physicians and involved in registrar teaching.<br/><br/>He and Nick Talley have been friends since they were registrars at Prince of Wales hospital preparing for their physicians exams. Their first book written together, Examination Medicine, was published in 1986 while they were still registrars. It is now in its 6th edition, with the 7th due at the end of 2013.<br/><br/>Before you buy the new medical student bible, come to this revealing session by Dr O’Connor as he shows you the secrets they don’t teach you during medical school. Featuring improvised clinical scenarios run by the OSCE-master himself, you will...shall we say...thank God you were here.<br/><br/>Presented by:<br/><center style="margin-bottom:5px;"><img src="files/views/assets/image/investec.jpg" style="width:150px;" /></center>');
}
if (selectedModule == "glen")
{
    $('#moduleTitle').html('<strong>Glen Gerreyn</strong><br/>AMSA Talk<br/>');
    $('#module').html('AMSA, the organisation that represents you and the 16,999 other medical students across Australia, values motivation, innovation, and passion; and there may not be anyone who embodies these qualities more so than Glen Gerreyn. Glen was set for a promising career in Athletics when his life took a turn for the worse and he was diagnosed with ulcerative colitis before ending up on a disability pension. Glen had two choices: to perpetuate an existence, or choose to fight back and have a life. Glen chose the latter. He went on to run a community centre that funded an Emergency Food Relief Program that has distributed over 20,000 food parcels to needy families in the Redcliffe area.<br/><br/>Glen is now a director for the Oxygen Factor which, like AMSA, has a passion for addressing mental health issues in our communities.<br/><br/>Presented by:<br/><center style="margin-bottom:5px;"><img src="files/views/assets/image/mips.jpg" style="width:150px;" /></center>');
}
if (selectedModule == "mccormack")
{
    $('#moduleTitle').html('<strong>James McCormack & Michael Allen</strong><br/>How Not to Get Fooled Again and Again: Staying Baffled and Bemused<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues2.jpg" style="width:155px;" /></center>Dr G. Michael Allan is an Associate Professor in the Department of Family Medicine at the University of Alberta and the Director of Evidence-Based Medicine. He is the director of the Alberta College of Family Physicians Evidence and CPD Program including the provincial CME Roadshows. Dr James McCormack has had extensive experience in evidence-based pharmacy, both locally and internationally, talking to health professionals and consumers about the rational use of medication, has presented over 300 seminars on drug therapy over the last 20 years.<br/><br/>Together, Drs Allan and McCormack have co-hosted over 200 weekly episodes of a popular podcast called the Therapeutics Education Collaboration. Aimed at health professionals in all fields, the two provide current, evidence-based, and practical information on rational drug therapy. They have a passion for educating clinicians, and encouraging shared decision-making and critical thinking in pharmacotherapy.');
}
if (selectedModule == "mansberg")
{
    $('#moduleTitle').html('<strong>Ginni Mansberg</strong><br/>Medicine in the Media<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues3.jpg" style="width:155px;" /></center>Dr Ginni Mansberg has been a General Practitioner since 1993. Her clinical interests include women’s health, paediatrics and mental health.  Author of bestselling books “How to get your Mojo Back” and “Why am I so Tired?” Ginni is also a speaker on health and wellness. She works as ambassador for Barnardos Australia, The National Prescribing Service and the General Practitioners Registrars’ Association. She teaches medical students at the University of Notre Dame in the discipline of General Practice.<br/><br/>With a Graduate Diploma in Journalism from the University of Technology, Sydney, Ginni’s other special interest is in health communication. In that capacity she is the Sunrise and Morning Show GP on Australia’s Channel Seven, covering the gamut of issues in Medical Science on Australia’s leading morning TV programs, as well as in her columns in numerous Australian magazines.<br/><br/>Join Ginni as she explores how the media works, why stories are chosen as newsworthy and how the media’s coverage of health stories will affect your practice.');
}
if (selectedModule == "dalley")
{
    $('#moduleTitle').html('<strong>Accessible Clinical Anatomy</strong><br/>Arthur Dalley<br/>');
    $('#module').html('Professor Arthur Dalley is a tenured Professor of Cell & Developmental Biology, and Director of Programs in Gross Anatomy and the Anatomical Donations Program at the Vanderbilt University School of Medicine, with Adjunct appointments Orthopaedics and Physical Therapy. He is co-author on textbooks and atlases including Clinically Oriented Anatomy, Essential Clinical Anatomy and Grant’s Atlas of Anatomy.<br/><br/>Are current textbooks still useful resources for new curricula? How can doctors in training benefit from changes in the medical classroom such as PBL, CBL, integrated case studies and peer teaching? Join Dr Dalley as he discusses this, and more.<br/><br/>Presented by:<br/><center style="margin-bottom:5px;"><img src="files/views/assets/image/lippincott.jpg" style="width:150px;" /></center>');
}
if (selectedModule == "pearn")
{
    $('#moduleTitle').html('<strong>A Passport to the World</strong><br/>Professor John Pearn<br/>');
    $('#module').html('Professor Pearn has served for twenty years as Professor and Head of the Department of Paediatrics at the RCH and Acting Dean of the UQ Faculty of Medicine. And for some, this might have been enough. But in a parallel career in military medicine, he served in Australia’s No. 1 Casualty Clearing Station as the Training Officer and as the Regimental Medical Officer for the Queensland University Regiment. As Major General John Pearn he served as Surgeon General to the Australian Defence Force from 1998 to 2001.  He is the author of some six hundred papers in the refereed literature; and the author of more than forty books relating to clinical medicine, medical history, toxinology, genetics and military medicine. <br/><br/>Allow Professor Pearn to broaden your horizons, and see how far your degree can take you.');
}
if (selectedModule == "rashford")
{
    $('#moduleTitle').html('<strong>The Ambulance Doctor</strong><br/>Dr Stephen Rashford<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues4.jpg" style="width:151px;" /></center>Meet Dr. Stephen Rashford, a specialist emergency physician and medical director for the Queensland Ambulance Service. His primary medical interests are prehospital resuscitation, trauma care and airway management. Dr Rashford is the clinical lead for Australia’s busiest out of hospital trauma service and has overseen the first accredited specialist training positions in prehospital care. He is an adjunct professor at QUR and also holds appointments at the RBWH in emergency medicine and with the trauma service. Come and hear what happens in a day in the life of The Ambulance Doctor; his stories will excite and evoke envy in Emergency and adrenaline junkies alike.');
}
if (selectedModule == "suturing")
{
    $('#moduleTitle').html('<strong>Suturing</strong><br/>');
    $('#module').html('Whether you’re a budding surgeon, or desperately needing to hone your skills to avoid cosmetic disasters, this session will give you a chance to get your hands dirty. Tutors will cover the basics of suturing and supervise hands-on practice for beginners, while simultaneously building the prowess of old-hands. Numbers are limited - get there early so you don’t miss out!');
}
if (selectedModule == "touch")
{
    $('#moduleTitle').html('<strong>Operation Smile: A UQ Capstone Experience</strong>');
    $('#module').html('Approximately 1 in 500 children in the developing world are born with a facial deformity. Approximately 1 in 700 children in developed countries are born with a facial deformity. Without reconstructive surgery, many will have difficulty breathing, eating, and speaking, leading to malnutrition, and medical and psychological problems. <br/><br/>Since its founding in 1982, more than 115,000 children and young adults have been treated by Operation Smile volunteers in 51 countries. In 1999, Dr Richard Lewandowski, a plastic and reconstructive surgeon, and his wife Sue, a physiotherapist, established Operation Smile Australia Limited, dedicated to helping children from countries in South East Asia. Be inspired by Dr Lewandowski and his incredible work, and learn how Operation Smile improves the lives of thousands of children every year.');
}
if (selectedModule == "finances")
{
    $('#moduleTitle').html('<strong>Doctoring Your Finances: How To Treat Your Bank Account</strong><br/>');
    $('#module').html('After many years of living on a shoestring budget, one of the most common comments from medical students is that they understand very little about finance and how to fund the purchases they want both before and after they graduate. Our workshop will quickly and effectively cover the most important ‘need to know’ finance basics for medical students, how to finance what you want and need as soon as possible and the key conceptual issues that affect the real cost of what you buy/finance.<br/><br/>Presented by:<br/><center style="margin-bottom:5px;"><img src="files/views/assets/image/investec.jpg" style="width:150px;" /></center>');
}
if (selectedModule == "rigby")
{
    $('#moduleTitle').html('<strong>The Man You Want On Your Team</strong><br/>Dr Barry Rigby<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues5.jpg" style="width:155px;" /></center>Picture this, you’re at the footy chomping on a pie and before you know it the captain of your team goes down like a tonne of bricks. What happens after your favourite athlete leaves the ground on a stretcher; will they ever be seen on the field again? Hideous head trauma, frightening fractures, and disgusting dislocations - Dr Barry Rigby has seen them all. As the Chief Medical Officer for the Gold Coast Suns AFL team, and the Medical Director of Pindara Emergency Department, he is going to share with you his experiences in treating the injuries of elite athletes.');
}
if (selectedModule == "goddard")
{
    $('#moduleTitle').html('<strong>Once Learned, Never Forgotten</strong><br/>Jennifer Goddard<br/>');
    $('#module').html('As medical students, we are constantly battered with facts that we expect our brain to absorb. Ever forgotten a patient’s name, a drug dosage or the phone number of the cute nurse in paediatrics? We’ve all been there. You’ve made mnemonics for your mnemonics and drawn mind maps that look like the London Underground - and it still isn’t enough. But even though it feels like we are at maximum capacity and our brain is designed to forget things it doesn’t use, it IS possible to improve your memory skills. Jennifer Goddard will share her wealth of experience and knowledge to ensure that you never fumble over a patient’s name again.');
}
if (selectedModule == "boyd")
{
    $('#moduleTitle').html('<strong>Research Skills: Standing on the Shoulders of Giants</strong><br/>Professor Rosalind Boyd<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues6.jpg" style="width:155px;" /></center>Isaac Newton once wrote, “If I have seen further, it is by standing on the shoulders of giants”. Research is a requirement for many specialist training programs, and there is increasing competition and pressure for young doctors to set themselves apart from their peers within the medical community. As a result, research experience is invaluable for any medical student. Whether you feel the pressure to get published but don’t know where to start, or if you are a science aficionado enticed by the unknown, join Professor Roslyn Boyd of the Queensland Cerebral Palsy Research and Rehabilitation Centre as she presents a crash course in how to conduct successful research: from getting started and learning the ropes, to publishing and practical applications. ');
}
if (selectedModule == "kay")
{
    $('#moduleTitle').html('<strong>Confronting the Myths - Medical Student Mental Health</strong><br/>Dr Margaret Kay<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues7.jpg" style="width:94px;" /></center>Studying medicine can be incredibly difficult and intense, and it’s no surprise that many studies show that medical students have an increased rate of stress and depression than the general population. One study suggested that almost 1 in every 4 will show signs of depression, and of those, 1 in 4 will have suicide ideation. In this workshop, Dr Margaret Kay will explore not only how to identify and manage your own mental health, but also how to look out for and care for your fellow students. Before we can look after patients, it’s important to know how to look after ourselves and our peers.');
}
if (selectedModule == "venepuncture")
{
    $('#moduleTitle').html('<strong>Venepuncture and Cannulation</strong><br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues8.jpg" style="width:155px;" /></center>Feeling a little blood-thirsty? Or maybe you just like sharp, pointy objects and opportunities to stick them into plastic arms. No matter which way you swing, if you want to brush up on how to take bloods or get IV access, we’ve got you sorted. After a session with us, the anaesthetics registrars will be begging you for tips!');
}
if (selectedModule == "choices")
{
    $('#moduleTitle').html('<strong>Choices and Consequences</strong><br/>');
    $('#module').html('University is a great time for learning (and for social activities).  Society generally recognises that university students need to blow off steam occasionally and minor infractions generally only result in minor consequences.  However the choices a medical student makes can impact the student’s career long after he or she has left University.  Students are now registered under the Health Practitioner Regulation National Law Act and have obligations to advise the regulator AHPRA of certain events. This session will provide you with a hypothetical case, highlighting that there are consequences for choices but also  support available to minimise the consequences.<br/><br/>Presented by:<br/><center style="margin-bottom:5px;"><img src="files/views/assets/image/avant.jpg" style="width:150px;" /></center>');
}
if (selectedModule == "eat")
{
    $('#moduleTitle').html('<strong>You Are What You Eat</strong>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues9.jpg" style="width:155px;" /></center>Here is one for the ethically minded - is it fair to advise your patients to eat a balanced meal when you’ve had Mi Goreng for dinner every night for the past week? Not to mention the ‘no carbs after dark’ rule, intermittent fasting, different types of protein powders, small regular meals, raw food diets... Even amongst health professionals, there is ambiguity of how to eat well and what constitutes a healthy, balanced diet. An accredited dietician is going to show us what we should be eating, and how this relates to our future work as doctors. This invaluable workshop will ensure you can maximize your own performance through your diet.');
}
if (selectedModule == "anderson")
{
    $('#moduleTitle').html('<strong>Performance Anxiety</strong><br/>Ruth Anderson<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues10.jpg" style="width:155px;" /></center>If you’ve ever been concerned about not being able to perform at your best when under pressure, don’t look for answers in magazine and radio advertisements, or giant brightly coloured billboards. Look no further than this workshop with Ruth Anderson, who has been a working psychologist for 17 years, and was the Head of Psychology Services for the Australian Olympic Team at the 2008 and 2012 Olympics. In this workshop, she will share her expert knowledge and teach you the skills to make sure that you don’t lose your head when that next exam comes around, stay calm when you’re faced with medical emergencies, and keep your cool when life turns up the heat.');
}
if (selectedModule == "amsaevents")
{
    $('#moduleTitle').html('<strong>It’s Your AMSA: Events</strong><br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues11.jpg" style="width:115px;" /></center>If you could organise an AMSA event in 2014, what would it look it? The “It’s Your AMSA” series provides you the opportunity to give feedback and direction straight to AMSA, your peak representative body. This session will be focusing on AMSA’s Events. AMSA runs superb events every year, including the Global Health Conference, National Leadership Development Seminar and, of course, our beloved National Convention. Are these events good enough? Are they safe enough? What other event would you like to see run? These are just some of the questions you can help us answer, as you have the opportunity to mould AMSA’s future events.');
}
if (selectedModule == "tran")
{
    $('#moduleTitle').html('<strong>Hip-Hop Dance</strong><br/>Stefanie Tran<br/>');
    $('#module').html('If you’re looking to grab a few moves for the dance floor tonight, or just want to jump in and have a bit of a groove, come to this fun workshop that will introduce you to some of the basics of hip-hop dancing. Bring comfy clothes and your dancing shoes, and get ready to step up and learn moves that will make Channing Tatum sweat in his high-tops.');
}
if (selectedModule == "arthur")
{
    $('#moduleTitle').html('<strong>Laparoscopy</strong><br/>Dr Thomas Arthur<br/>');
    $('#module').html('Remember those games that you used to play when you were little, which involved stacking different coloured rings on top of one another? Well now you’re all grown up. And instead of basic colour and shape recognition, you can now learn advanced surgical techniques in an opportunity like no other. The dashing Dr Thomas Arthur, a surgical registrar at the Gold Coast Hospital, will show you the principles behind laparoscopic surgery; guide you through understanding the “laparoscopic stack” and then let you practice your skills using real laparoscopic equipment and training models. Think you’ve got the hand-eye coordination?');
}
if (selectedModule == "intern")
{
    $('#moduleTitle').html('<strong>Shit I Wish I Knew as an Intern</strong><br/>');
    $('#module').html('Worried about graduating? Scared about saving lives in the real world? What do you REALLY need to know after your graduate from medical school? Beat your anxiety - come and learn a few tips and tricks to help you survive your intern year. Featuring our immensely wise panel of junior doctors and registrars, we will let you in on the lessons your medical school doesn’t teach you, and ensure that you will impress all of your consultants and ace your intern year.');
}
if (selectedModule == "brett")
{
    $('#moduleTitle').html('<strong>Good Food Fast, Not Fast Food</strong><br/>Dom Brett<br/>');
    $('#module').html('Tired of eating baked beans and tuna? Does “breakfast for dinner” happen more often than you’d like to admit? Ditch the classic dodgy student-life food and let us transform you into a domestic god/goddess. Rather than resting and digesting the same boring meals every night or letting takeaway consume your income, join Dom Brett from MasterChef Season 4 as he shows you how to create quick, healthy and cheap meals that are guaranteed to impress.');
}
if (selectedModule == "ecgs")
{
    $('#moduleTitle').html('<strong>Easy ECGs</strong><br/>Professor Rohan Jayasinghe<br/>');
    $('#module').html('If you struggle with ST segments, are addled by axes, or if you have queries about the QRS complex, this workshop is one not to be missed! Professor Rohan Jayasinghe, Director of Cardiology at the Gold Coast Hospital, and author of Mastering the Medical Long Case and ECG Workbook, will guide you through the ups and downs of interpreting ECGs. Whether you’re in first or final year, this one-hour intensive will straighten out the squiggles and help you become proficient in this vital skill.');
}
if (selectedModule == "yoga")
{
    $('#moduleTitle').html('<strong>Yoga</strong><br/>Emma Ferguson<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues12.jpg" style="width:155px;" /></center>Come along to an invigorating afternoon of flow and play. This flow-style yoga class will help you open up and get you ready for an amazing week. You will be taught by one of GC 2013’s very own, Emma Ferguson, who has been teaching yoga for the past 6 years and has over 1000 hours of training as a yoga teacher. Be prepared to sweat and stretch it out. Bring along a towel or yoga mat and a water bottle. See you on the mat!');
}
if (selectedModule == "mod")
{
    $('#moduleTitle').html('<strong>Michael</strong><br/>How<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/tues1.jpg" /></center>');
}
                    

