                    var selectedModule = localStorage.getItem("selectedModule");
if (selectedModule == "cregan")
{
    $('#moduleTitle').html('<strong>Patrick Cregan</strong><br/>The Reality of Virtual Medicine<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/thurs1.jpg" style="width:155px;" /></center>Associate Professor Patrick Cregan is a specialist surgeon with a major interest in endocrine and endoscopic surgery based at Nepean Hospital. He has a particular interest in surgical robotics, having performed Australia’s first and the world’s sixth Telesurgical procedure. Other interests include research interest in mathematical modelling of cancer, patient communication and the application of advanced technologies. Patrick has served on a number of committees/boards including NSW Cancer Institute, NSW Cancer Council, the Royal Australian College of Surgeons NSW State committee, Wentworth Area Health Service, NSW Health Clinical Council, the Australasian Medical Simulation Society and a listed Medical Technology and Research Company, Medicvision. Patrick was formerly the Chair of the NSW Surgical Services Taskforce from its inception until early this year and is currently the Chairman of the Board of the Nepean Blue Mountains Local Health District. As a leader in hapto-visual environments and surgical robotics, and a key player in the development of the VirtualCCU, Associate Professor Cregan will open your eyes to what the future has in store.');
}
if (selectedModule == "digital")
{
    $('#moduleTitle').html('<strong>Going Digital: What Does It All Mean?</strong><br/>');
    $('#module').html('In 2011, UnitingCare Health (UCH) received a $47M federal grant from the Health and Hospitals Fund (HHF) to build a new greenfield site digital hospital in Hervey Bay. The 96 bed hospital is scheduled to open in September 2014 and will feature Australia’s first integrated digital architecture. The digital hospital is being designed in a unique collaborative partnership with Cerner, the health information technology vendor selected by UCH for the project. Over twenty eHealth applications and technology solutions will be included in the digital hospital. In this morning’s presentation, UCH and Cerner leaders will provide an insight into progress and process of creating the digital hospital including its elements, clinical transformation work redesign, doctor engagement strategies, and expected benefits to be realized, including the goal to open as a designated Level 6 Healthcare Information and Management Systems Society (HIMSS) facility.');
}
if (selectedModule == "ford")
{
    $('#moduleTitle').html('<strong>Peter Ford</strong><br/>The Key to Locked-In Syndrome<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/thurs2.jpg" style="width:155px;" /></center>Peter is Founder and CEO of Control Bionics, the maker of NeuroSwitch, an EMG-driven communications and control system designed for people with quadriplegia and loss of speech. He began developing Assistive Technology (AT) as an aside, while a news anchor at CNN in Atlanta in 1982, after developing a virtual robotics program for early Apple computers. Peter gained more work as a software consultant on a number of assignments involving extreme disability. After re-programming a clinical EMG monitor, Peter created a system which provided a patient with severe paralysis a means to signal “Yes” and “No” for the ?rst time in over a decade.<br/><br/>This was the genesis of NeuroSwitch, providing full text, text-to-speech, computer control, and remote control of telepresence robotics systems for 2-way audio-visual communication and movement. With NeuroSwitch now being further developed in Australia, you will be some of the first to see this life-changing technology in action.');
}
if (selectedModule == "hayman")
{
    $('#moduleTitle').html('<strong>Noel Hayman</strong><br/>Indigenous Healthcare Excellence<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/thurs3.jpg" style="width:155px;" /></center>Dr Noel Hayman was one of the first two Indigenous medical students to graduate from the University of Queensland in 1990.<br/><br/>Noel is Clinical Director of the Inala Indigenous Health Service in Brisbane. In developing this service, he has been instrumental in demonstrating how mainstream primary health care services can be made appropriate to the needs of urban Aboriginal populations. Noel’s interests include improving Indigenous access to mainstream health services and supporting medical education in Indigenous health.');
}
if (selectedModule == "decosta")
{
    $('#moduleTitle').html('<strong>The Future of Abortion in Australia</strong><br/>Caroline De Costa<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/thurs4.jpg" style="width:155px;" /></center>Caroline de Costa is professor of obstetrics and gynaecology at James Cook University School of Medicine, Cairns, and an established writer. She has a particular interest in obstetric epidemiology and in the reproductive health of disadvantaged women in our society. She has published a number of textbooks and books of health information for women. She has been a longtime advocate of reform to Australia’s abortion laws and of improvements to access for Australian women to both contraceptive and abortion services.');
}
if (selectedModule == "amsainitiatives")
{
    $('#moduleTitle').html('<strong>It’s Your AMSA: Initiatives and Campaigns</strong><br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/thurs5.jpg" style="width:115px;" /></center>How would you energise and mobilise the 17,000 medical students in Australia around an issue? This session will be focusing on AMSA’s Initiatives and Campaigns. Over the past few years AMSA has run a National Blood drive and the Get A GP Campaign, to name just two campaigns. What grassroots campaign would you organize in 2014? Hear from your fellow medical students about how we can better engage with medical students across Australia and take up the opportunity to discuss and critique the ideas.');
}
if (selectedModule == "facepainting")
{
    $('#moduleTitle').html('<strong>Anatomical Face Painting</strong><br/>Grace Murphy<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/thurs6.jpg" style="width:155px;" /></center>Know this right now: you are beautiful on the inside. You are soft, warm, and exquisitely complex. Now’s your chance to show off your inner beauty to the world, with some truly spectacular (and anatomically correct) body art! Whether you’re bored by painting still life, or want a more creative way to study anatomy, it’s time to break out the brushes and explore what lies beneath. You may even be able to get a head start on your costume for the evening.');
}
if (selectedModule == "bivacor")
{
    $('#moduleTitle').html('<strong>The Unbreakable Heart</strong><br/>BiVACOR<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/thurs7.jpg" style="width:155px;" /></center>Think you need a pulse to survive?  Think again!  As the doctors of the future, it is YOU, the delegates of GC2013 who will navigate this world through as-yet unimaginable medical frontiers.  BiVACOR, a Queensland-based group of doctors, engineers and scientists have found their frontier, and are determined to make the perfect artificial heart.  Come and find out how they’re doing it.  This talk promises to inspire you and to challenge everything you thought you knew about medicine, technology and the limits of human ingenuity.');
}
if (selectedModule == "cregan2")
{
    $('#moduleTitle').html('<strong>Economics and Affordability of Healthcare</strong><br/>Dr Patrick Cregan<br/>');
    $('#module').html('If you’re the type of medical student who is so focussed on their degree that anything outside of medicine is completely forgotten, you may be forgiven for thinking economics are a new class of antibiotics. What you might not realise, though, is that health economics is big business. Annual revenue for Australian health systems rivals that of petroleum companies, and is set to increase! As healthcare expenditure rises, it is inevitable that hospital funding must change, and we will be the ones who will have to make the hard decisions. Join Patrick Cregan as he explores the financial future of your career.');
}
if (selectedModule == "birthingkits")
{
    $('#moduleTitle').html('<strong>Birthing Kits</strong><br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/thurs8.jpg" style="width:152px;" /></center>Every 90 seconds a woman dies of complications related to childbirth. 99% of these deaths occur in developing countries, and most of these deaths are entirely preventable. Complications such as infections and haemorrhage can arise from the lack of trained perinatal care, poor infection control and poverty of sterile medical supplies. During this workshop, you will assemble clean birthing kits that are used during childbirth and significantly reduce maternal and infant mortality rates in countries like Vietnam, Ethiopia, Kena, PNG and Afghanistan. So come along and learn how to address this major issue in global maternal health, and be a part of the assembly of simple birthing kits that can help mothers bring their children into this world safely. Their lives are in your hands.');
}
if (selectedModule == "luxford")
{
    $('#moduleTitle').html('<strong>Incorporating Alternative Medicine</strong><br/>Dr Yoni Luxford<br/>');
    $('#module').html('The global increase in consumer demand for alternative medicine places an undeniable expectation on doctors to have at least a basic understanding of their place in health and healing. Research shows that the majority of consumers do not trust their doctors enough to disclose their use of herbal and complementary therapies. Come to this engaging and interactive workshop with Dr Yoni Luxford, and see the evidence behind alternative medicines through a patient-centered approach. You’ll also tackle case studies, and see real-life examples of complementary therapies in action!');
}
if (selectedModule == "good")
{
    $('#moduleTitle').html('<strong>The Future of Malaria</strong><br/>Professor Michael Good<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/thurs9.jpg" style="width:155px;" /></center>What do you get when you cross a doctor, a milkmaid, and a gardener’s son? The eradication of smallpox. Human life expectancy is increasing three months every year, and nearly all the gains in better health can be traced to medical research. One of the standout success stories of the last 100 years has been the development of vaccines. While many vaccines are available, those that could protect against virulent and highly variable organisms, such as Plasmodium spp, HIV and Streptococcus pyogenes remain elusive. Professor Goode’s laboratory has been developing alternative strategies and is trialing new vaccines for Streptococcus and malaria, and this afternoon you will have the opportunity to see where the future of vaccine research lies!');
}
if (selectedModule == "gannon")
{
    $('#moduleTitle').html('<strong>Is Research Useful?</strong><br/>Professor Frank Gannon<br/>');
    $('#module').html('For many, the title of this talk is merely a rhetorical question.  However, the need to ask the question is very relevant at times when funding for research is being closely analysed.  Tracing his own career and through it a variety of different research areas, up to his current role as the Director of the Queensland Institute of Medical Research, Professor Frank Gannon will address this topic and provide examples where research, which may not have been immediately viewed as “useful”, has provided beneficial and practical outcomes.');
}
if (selectedModule == "weinstein")
{
    $('#moduleTitle').html('<strong>Medicine in the Pacific</strong><br/>Dr Stephen Weinstein<br/>');
    $('#module').html('The decision to pursue a career in global health is one not to be taken lightly, but can deliver tremendous personal fulfilment. From experiencing different cultures, to working with NGOs and foreign politics, bringing your skills to a country in need may be the best adventure you could ever take. Join Dr Stephen Weinstein for an inspiring foray into the public health initiatives and future health programs he is working on in the Pacific. Be enthralled by his tales of aid work in countries such as Guam, Fiji, Samoa and Tonga in this incredible workshop!');
}
if (selectedModule == "mcrae")
{
    $('#moduleTitle').html('<strong>Climate Change and Medicine</strong><br/>Dr Dave McRae<br/>');
    $('#module').html('From intense drought to flooding rains, Australia’s weather runs the full spectrum of serenity to chaotic destruction. As climate change continues to alter the world we live in, Australia’s climate will inevitably change, bringing with it alterations in disease patterns and significant repercussions for our health care system. It’s a huge and often daunting topic, but this workshop by David McRae from the Queensland Department of Science, Information Technology, Innovation and the Arts is where you can start getting answers to the important questions - how we’ll be affected, and how we must adapt.');
}
if (selectedModule == "mod")
{
    $('#moduleTitle').html('<strong>Michael</strong><br/>How<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/thurs1.jpg" /></center>');
}
                    






