j_1676_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_1679',
        'panel_3': 'j_1681',
        'panel_4': 'j_1682',
        'mobilenavbar_5': 'j_1684',
        'mobilenavbaritem_6': 'j_1685',
        'mobilenavbaritem_9': 'j_1686'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_1676';

    /*
     * Nonvisual components
     */
    var datasources = [];

    /*
     * Events and handlers
     */
    j_1676_beforeshow = function() {
        Appery.CurrentScreen = 'j_1676';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_031E_onLoad = j_1676_onLoad = function() {
        screen_031E_elementsExtraJS();
		
		$('.mobileFooter').css('min-height', '0px');

        j_1676_deviceEvents();
        j_1676_windowEvents();
        screen_031E_elementsEvents();
    }

    // screen window events
    screen_031E_windowEvents = j_1676_windowEvents = function() {
        $('#j_1676').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });

    }

    // device events
    j_1676_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_031E_elementsExtraJS = j_1676_elementsExtraJS = function() {
        // screen (screen-031E) extra code

    }

    // screen elements handler
    screen_031E_elementsEvents = j_1676_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_1678 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('startScreen', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

        $('#j_1683 [name="mobilenavbaritem_9"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('SpeakerList', {
                        transition: 'slide',
                        reverse: false
                    });

                }
            },
        });

    }

    $("#j_1676").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_1676_beforeshow();
    });

    if (runBeforeShow) {
        j_1676_beforeshow();
    } else {
        j_1676_onLoad();
    }

}

