                    var selectedModule = localStorage.getItem("selectedModule");
if (selectedModule == "kidd")
{
    $('#moduleTitle').html('<strong>Michael Kidd</strong><br/>How to Change the World<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon1.jpg" style="width:150px;" /></center>Professor Michael Kidd AM is the incoming president of the World Organization of Family Doctors. He is a past president of the Royal Australian College of General Practitioners and is the executive dean of the Faculty of Health Sciences at Flinders University. He is a director of several companies including beyondblue, General Practice Education and Training (GPET), the Arts and Health Foundation and Therapeutic Guidelines Limited. He is the author of several books including First Do No Harm: being a resilient doctor in the 21st century. Join Professor Kidd as he shares his own experiences off the grid, and discusses how to ensure equity of healthcare the world over.');
}
if (selectedModule == "controversial")
{
    $('#moduleTitle').html('<strong>Controversial Issues Panel</strong><br/>Sally Cockburn, Michael Kidd, Alex Markwell, Ben Veness<br/>');
    $('#module').html('There are things in medicine we rarely get the chance to talk about, but play an important part in our careers and continuing care for patients. Including topics like sex, social media, abortion, euthanasia, wages and access to training. There are many taboos that exist which prevent frank discussion. And why can’t gay men donate blood?! Our expert panel will be lead by Convention legend Dr Sally Cockburn, in an intimate session where nothing is off-limits. Come and ask those controversial questions you’ve always wanted to, because the answers may not be what you expect!');
}
if (selectedModule == "perry")
{
    $('#moduleTitle').html('<strong>Lucy Perry</strong><br/>The Challenges of Medicine in Africa<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon2.jpg" style="width:155px;" /></center>Lucy went from volunteer to CEO in eight years, working with Dr Catherine Hamlin, the Addis Ababa Fistula Hospital and the Hamlin College of Midwives in Ethiopia. She heads up fundraising and awareness in Australia for an organisation which treats Ethiopian women with obstetric fistula and trains local midwives to prevent these injuries in future. She travels to Ethiopia several times a year, and will this year speak at Convention on the challenges of practising medicine in Africa, providing insight from her work with Hamlin Fistula Ethiopia');
}
if (selectedModule == "bonning")
{
    $('#moduleTitle').html('<strong>Michael Bonning</strong><br/>beyondblue’s National Mental Health Survey of Doctors & Medical Students<br/>');
    $('#module').html('Dr Michael Bonning is the Board Director of beyondblue and is a fleet medical officer for the Royal Australian Navy. He finds his work with beyondblue particularly rewarding because of how quickly ideas can turn into actions. As well as community-level projects, beyondblue is an organisation that thinks big and tackles the inequities of health care access for all Australians.<br/><br/>Come and join us as Dr Bonning presents the results of the landmark National Mental Health Survey of Doctors and Medical Students conducted in February 2013. He will offer an unprecedented insight into the wellbeing of the nation’s aspiring and working doctors.<br/><br/>Presented by:<br/><center style="margin-bottom:5px;"><img src="files/views/assets/image/beyondblue.jpg" style="width:81px;" /></center>');
}
if (selectedModule == "murtagh")
{
    $('#moduleTitle').html('<strong>Memorable Cases and Lessons Learned</strong><br/>John Murtagh<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon3.jpg" style="width:150px;" /></center>Professor John Murtagh MD, MBBS, BSc, BEd, FRACGP is an Emeritus Professor of Monash University and Professorial Fellow in the Department of General Practice, University of Melbourne. He is Patron of the General Practitioners Registrar’s Association and practices part-time in general practice. Notably, he is the author of several internationally adopted textbooks including General Practice, Practice Tips, Patient Education and Cautionary Tales.<br/><br/>Come and join us in this session, as this medical legend takes us through the cases that he’ll never forget.<br/><br/>Presented by:<br/><center style="margin-bottom:5px;"><img src="files/views/assets/image/racgp.jpg" style="width:150px;" /></center>');
}
if (selectedModule == "selvey")
{
    $('#moduleTitle').html('<strong>Can You Stop Global Warming With A Condom?</strong><br/>Linda Selvey<br/>');
    $('#module').html('As sea levels rise, global temperature creep ever higher, and penguins start buying snow-cones, it’s time we asked ourselves; what can one man do to save the world? Leave the freezer open overnight? Join us and Linda Selvey, the CEO of Greenpeace Australia Pacific, in learning why using a condom could be one of the most effective ways of helping to reduce global warming. Use a condom, catch knowledge!');
}
if (selectedModule == "survivor")
{
    $('#moduleTitle').html('<strong>Survivor: GC2013</strong><br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon4.jpg" style="width:151px;" /></center>Imagine you’ve dropped your smartphone in a creek on your long run. And now you’re lost in the Gold Coast Hinterland. You didn’t want to eat before you left for your run, so now you’re starving too... Don’t panic. The Queensland Bushfoods Association are here to show you what to do before resorting to eating animal dung and drinking your own urine. Come to The Tree Room and learn about the bush foods that have sustained people in Australia for millennia, and the uses of medicinal plants that will save your bacon in the bush. Then, after your rescue, learn how to use your newfound knowledge to impress your dinner guests with amazing native flavours. Bear Grylls would be proud.');
}
if (selectedModule == "youramsa")
{
    $('#moduleTitle').html('<strong> It’s Your AMSA: Advocacy</strong><br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon5.jpg" style="width:115px;" /></center>If you had the ear of the media, what would you want AMSA to advocate for? This session will be focusing on AMSA’s Advocacy. In 2013 the National Executive identified Internships and Student Mental Health as their key priority areas. What do you think the biggest issue for 2014 will be? What should AMSA be doing about it? <br/><br/>Come to this workshop to listen, debate, and have your voice heard regarding AMSA and Advocacy.');
}
if (selectedModule == "toombs")
{
    $('#moduleTitle').html('<strong>Crossing Cultures: A Hidden History</strong><br/>Dr Maree Toombs<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon6.jpg" style="width:151px;" /></center>Dr Maree Toombs is a researcher at Queensland’s Centre for Rural and Remote Area Health. Her fascinating workshop will examine the untold history of Indigenous Australia, its culture and relationship with colonialism, and the impact of these factors on Indigenous health today. It is a fun, interactive workshop, sometimes light-hearted, sometimes poignant. Dr Toombs takes great pain to emphasise that this, above all, is not a guilt trip! By the end of the session, you’ll be so inspired that you will be on the next plane to a remote Northern Territory Indigenous community.');
}
if (selectedModule == "weaver")
{
    $('#moduleTitle').html('<strong>Childbirth 101: How to Survive a Bush Delivery</strong><br/>Dr Ted Weaver<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon7.jpg" style="width:151px;" /></center>Ever wondered how you would cope if you were the only person available to deliver a baby? Are you about to head off for elective and need a quick refresher? Or does the idea of childbirth just terrify you? Never fear, this is the session for you! Erase any memories of watching home-birthing videos on YouTube. You will run through the basics of delivering a baby, in exciting and interactive clinical scenarios, with experienced rural obstetrician Dr Ted Weaver.');
}
if (selectedModule == "jamieson")
{
    $('#moduleTitle').html('<strong>The Life of an MSF Doctor</strong><br/>Dr Jennifer Jamieson<br/>');
    $('#module').html('Have you ever wanted to work overseas as a doctor in third-world countries, or areas of need? Join us for this eye-opening session, where Jennifer Jamieson will speak about her work with MSF in Afghanistan, some of the ethical challenges of engaging in overseas medical work and the take-home principles for those interested in pursuing overseas medical humanitarian work.<br/><br/>Jennifer is an emergency registrar working at Alfred Health in Melbourne. During 2012, she worked with Médecins Sans Frontières and spent six months working in Kunduz, Afghanistan at a trauma hospital. ');
}
if (selectedModule == "scartissue")
{
    $('#moduleTitle').html('<strong>Scar Tissue</strong><br/>Stephanie Hodson & Wayne Penniall<br/>');
    $('#module').html('They say that every generation has its war, and if we look back, they’re not far off. World Wars, Gulf Wars, Civil wars, the War on Terror; the list is endless. The atrocities that war can inflict upon individuals are of growing concern. The most obvious are the physical disabilities, but less-publicised is the psychological trauma that can often present decades after serving. Come and gain some insight into the less visible after-effects of war on the human mind, as Stephanie Hodson, the Mental Health Advisor to the Department of Veteran Affairs, and Wayne Penniall, psychologist and the National Manager of Veterans’ and Veterans’ Families Counselling Service, help us learn what we can do to aid those who have suffered the brutality of war.');
}
if (selectedModule == "offgrid")
{
    $('#moduleTitle').html('<strong>Medicine Off the Grid</strong><br/>Dr Victoria Brazil<br/>');
    $('#module').html('Come and discover what to do when you are put on the spot with limited time, resources and technology . Be prepared to be put through your paces during ingenious clinical scenarios run by an experienced emergency doctor. Learn how to keep calm and manage the Patient as they come into a small, rural hospital. You have your hands, your steth and your wits. Go!');
}
if (selectedModule == "cox")
{
    $('#moduleTitle').html('<strong>A Day in the Life of a Royal Flying Doctor</strong><br/>Dr Carol Cox<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon8.jpg" style="width:155px;" /></center>It’s a bird! It’s a plane! It’s....a doctor in a plane! The supermen and women of the RFDS deliver medical assistance to one person every 2 minutes. Ever wonder what it’s like to fly through the skies and bring quality healthcare to those who need it most? Dr Carol Cox will guide you on an exciting journey through a day in the life of a Royal Flying Doctor. Find out if you’ve got what it takes to join the ranks of this uniquely Australian organization.');
}
if (selectedModule == "moore")
{
    $('#moduleTitle').html('<strong>Sexuality and LGBTQI in Medicine</strong><br/>Dr Drew Moore<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon9.jpg" style="width:155px;" /></center>“So, do you have a girlfriend?” It’s an innocuous question, and might seem a good opener to asking a young male patient about his sexual history. But how you deal with the answer may alienate your patient if you are unable to sensitively address any differences in their sexual experience and identity. As clinicians, providing a supportive environment for LGBTI patients is both important and challenging. It’s particularly important since non-straight identified patients face a higher burden of disease than their straight counterparts, including poor mental health and lack of access to inclusive sexual health and family planning services.  In this workshop, Dr Drew Moore, an expert in medical education with years of experience working with the LGBTI community, will guide you through these sensitive issues and teach you skills that can be applied in all clinical interactions. ');
}
if (selectedModule == "proctor")
{
    $('#moduleTitle').html('<strong>Lack of Vision in Developing World Health</strong><br/>Dr Murray Proctor<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon10.jpg" style="width:155px;" /></center>Can’t see yourself making it through the whole week at Convention? Imagine not being able to see yourself in the mirror. The majority of blindness in the developing world is preventable. Come to a workshop hosted by Murray Proctor, and get a glimpse of how you can use your degree to in a variety of ways to aid those less fortunate. His enormous experience in health issues such as avoidable blindness and foreign aid will help you see how you can make the world a brighter, clearer place for all.');
}
if (selectedModule == "tips")
{
    $('#moduleTitle').html('<strong>Tips for Being a Deadly Doctor</strong><br/>Institute for Urban Indigenous Health<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon11.jpg" style="width:155px;" /></center>Did you know that diabetes is definitely not deadly? That not everyone you talk to shares your concept of time? That where you come from may well be more important than what your name is? Come along to this workshop with the Institute for Urban Indigenous Health (IUIH) to get a tantalising glimpse into how your cultural awareness can enrich your life and improve your practice as a doctor.');
}
if (selectedModule == "heart")
{
    $('#moduleTitle').html('<strong>The Heart of the Pacific</strong><br/>Dr Vijay Kapadia<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon12.jpg" style="width:155px;" /></center>Dr Vijay Kapadia tells a compelling story about the efforts to help develop an integrated and comprehensive cardiac service for Fiji and, from there, the Pacific region. He chronicles the difficult but very heart warming, challenging and interesting journey that the doctors of Fiji Heart have been a part of in their efforts to achieve this goal. This has led to an ever widening collection of committed individuals and groups both in Fiji and abroad coming together to advance this cause. Fiji Heart is about the challenges and the opportunities to usher in a new path to develop badly needed cardiac services in Fiji and the region.');
}
if (selectedModule == "mod")
{
    $('#moduleTitle').html('<strong>Michael</strong><br/>How<br/>');
    $('#module').html('<center style="margin-bottom:5px;"><img src="files/views/assets/image/mon1.jpg" /></center>');
}
                    






