j_1317_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_1320',
        'panel_11': 'j_1322'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_1317';

    /*
     * Nonvisual components
     */
    var datasources = [];

    /*
     * Events and handlers
     */
    j_1317_beforeshow = function() {
        Appery.CurrentScreen = 'j_1317';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_0B9D_onLoad = j_1317_onLoad = function() {
        screen_0B9D_elementsExtraJS();


        j_1317_deviceEvents();
        j_1317_windowEvents();
        screen_0B9D_elementsEvents();
    }

    // screen window events
    screen_0B9D_windowEvents = j_1317_windowEvents = function() {
        $('#j_1317').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });

    }

    // device events
    j_1317_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_0B9D_elementsExtraJS = j_1317_elementsExtraJS = function() {
        // screen (screen-0B9D) extra code

    }

    // screen elements handler
    screen_0B9D_elementsEvents = j_1317_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_1319 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    history.back();

                }
            },
        });

    }

    $("#j_1317").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_1317_beforeshow();
    });

    if (runBeforeShow) {
        j_1317_beforeshow();
    } else {
        j_1317_onLoad();
    }

}

$("#j_1317").die("pageinit").live("pageinit", function(event, ui) {
    Appery.processSelectMenu($(this));
    j_1317_js();
});

