j_454_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_3': 'j_457',
        'panel_2': 'j_459'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_454';

    /*
     * Nonvisual components
     */
    var datasources = [];

    /*
     * Events and handlers
     */
    j_454_beforeshow = function() {
        Appery.CurrentScreen = 'j_454';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_201F_onLoad = j_454_onLoad = function() {
        screen_201F_elementsExtraJS();

        j_454_deviceEvents();
        j_454_windowEvents();
        screen_201F_elementsEvents();
    }

    // screen window events
    screen_201F_windowEvents = j_454_windowEvents = function() {
        $('#j_454').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });
        $('#j_454').bind({
            pageshow: function() {
                $("#interact").html('<div style="text-align:center; width:100%;" class="ui-icon-loading"></div>').load('http://m.convention2013.amsa.org.au/app/interact.php');
            },
        });

    }

    // device events
    j_454_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_201F_elementsExtraJS = j_454_elementsExtraJS = function() {
        // screen (screen-201F) extra code

    }

    // screen elements handler
    screen_201F_elementsEvents = j_454_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_456 [name="mobilebutton_3"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('startScreen', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

    }

    $("#j_454").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_454_beforeshow();
    });

    if (runBeforeShow) {
        j_454_beforeshow();
    } else {
        j_454_onLoad();
    }

}

