j_258_js = function(runBeforeShow) { /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_2': 'j_261',
        'mobilelist_7': 'j_263',
        'mobilelistitem_8': 'j_264',
        'mobilelistitembutton_9': 'j_265',
        'mobilelistitem_10': 'j_266',
        'mobilelistitembutton_11': 'j_267',
        'title': 'j_268',
        'date': 'j_269',
        'id': 'j_270',
        'mobilenavbar_3': 'j_272',
        'mobilenavbaritem_4': 'j_273',
        'Notifications': 'j_274'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    Appery.CurrentScreen = 'j_258';

    /*
     * Nonvisual components
     */
    var datasources = [];

    getNotifications = new Appery.DataSource(Notification_list, {
        'onComplete': function(jqXHR, textStatus) {

            $t.refreshScreenFormElements("j_258");
        },
        'onSuccess': function(data) {},
        'onError': function(jqXHR, textStatus, errorThrown) {},
        'responseMapping': [{
            'PATH': ['total', 'total'],
            'ID': '___local_storage___',
            'ATTR': 'notificationNumber'
        }, {
            'PATH': ['entry'],
            'ID': 'mobilelistitem_10',
            'SET': [{
                'PATH': ['id'],
                'ID': 'id',
                'ATTR': '@'
            }, {
                'PATH': ['time'],
                'ID': 'date',
                'ATTR': '@'
            }, {
                'PATH': ['title'],
                'ID': 'title',
                'ATTR': '@',
                'TRANSFORMATION': function(value, element) {
                    var read = [];

                    var storedRead = localStorage.getItem("readNotifications");
                    if (storedRead) {
                        read = JSON.parse(storedRead);
                    } else {
                        localStorage.setItem("readNotifications", JSON.stringify(read));
                    }

                    if (read.indexOf(value) > -1) {
                        return value;
                    } else {
                        var display = "<span style='font-weight:bold; color:red;'>> " + value + "</span>";
                        return display;
                    }
                }
            }]
        }],
        'requestMapping': [{
            'PATH': ['k'],
            'ID': '___local_storage___',
            'ATTR': 'currentUserAuth'
        }]
    });

    datasources.push(getNotifications);

    /*
     * Events and handlers
     */
    j_258_beforeshow = function() {
        Appery.CurrentScreen = 'j_258';
        for (var idx = 0; idx < datasources.length; idx++) {
            datasources[idx].__setupDisplay();
        }
    }
    // screen onload
    screen_2045_onLoad = j_258_onLoad = function() {
        screen_2045_elementsExtraJS();

        $('.mobileFooter').css('min-height', '0px');
        $('.pagefooter').css('margin-bottom', '-3px');;
        try {
            getNotifications.execute({})
        } catch (ex) {
            console.log(ex.name + '  ' + ex.message);
            hideSpinner();
        };
        var totalnotifications = parseInt(localStorage.getItem("notificationNumber"));
        var readnotifications = parseInt(localStorage.getItem("totalReadNotifications"));
        if (readnotifications) {
            if (readnotifications < totalnotifications) {
                var unread = totalnotifications - readnotifications;
            }
        } else {
            var unread = totalnotifications;
        }
        if (unread) {
            Appery('Notifications').children(".ui-btn-inner").append("<div style='float:right; position:absolute; top:5px; right:7px; background:#430000; padding:3px 5px 3px 5px; border:1px solid #F90; -webkit-border-radius:5px; border-radius:5px; -moz-border-radius:5px; '>" + unread + "</div>");
            var startscreennote = document.getElementById("snote");
            if (startscreennote) {
                startscreennote.parentNode.removeChild(startscreennote);
            }
            $('#j_885').css("position", "relative");
            $('#j_885').append("<div id='snote' style='float:right; position: absolute; top:0; right:0; background: rgb(122, 69, 0); padding:3px 5px 3px 5px; border:1px solid #F90; -webkit-border-radius:5px; border-radius:5px; -moz-border-radius:5px; font-size: 14px;'>" + unread + "</div>");
        } else {
            var startscreennote = document.getElementById("snote");
            if (startscreennote) {
                startscreennote.parentNode.removeChild(startscreennote);
            }
        };

        j_258_deviceEvents();
        j_258_windowEvents();
        screen_2045_elementsEvents();
    }

    // screen window events
    screen_2045_windowEvents = j_258_windowEvents = function() {
        $('#j_258').bind('pageshow orientationchange', function() {
            adjustContentHeightWithPadding();
        });

    }

    // device events
    j_258_deviceEvents = function() {

        document.addEventListener("deviceready", function() {

        });
    }

    // screen elements extra js
    screen_2045_elementsExtraJS = j_258_elementsExtraJS = function() {
        // screen (screen-2045) extra code

        /* mobilelist7 */

        listView = $("#j_263");
        theme = listView.attr("data-theme");
        if (typeof theme !== 'undefined') {
            var themeClass = "ui-btn-up-" + theme;
            listItem = $("#j_263 .ui-li-static");
            $.each(listItem, function(index, value) {
                $(this).addClass(themeClass);
            });
        }

        /* mobilelistitem_8 */

        /* mobilelistitem_10 */

    }

    // screen elements handler
    screen_2045_elementsEvents = j_258_elementsEvents = function() {

        $("a :input,a a,a fieldset label").live({
            click: function(event) {
                event.stopPropagation();
            }
        });

        $('#j_260 [name="mobilebutton_2"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    var uid = localStorage.getItem('currentUserId');
                    if (uid == "Guest") {
                        Tiggzi.navigateTo('guestScreen', {
                            transition: 'slide',
                            reverse: true
                        });
                    } else {
                        Tiggzi.navigateTo('startScreen', {
                            transition: 'slide',
                            reverse: true
                        });
                    };

                }
            },
        });

        $('#j_262 [name="mobilelistitem_10"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    setVar_('selectedNotification', 'j_270', 'text', '', this);
                    Appery.navigateTo('notificationView', {
                        transition: 'slide',
                        reverse: false
                    });

                }
            },
        });

        $('#j_271 [name="mobilenavbaritem_4"]').die().live({
            click: function() {
                if (!$(this).attr('disabled')) {
                    Appery.navigateTo('eNews', {
                        transition: 'slide',
                        reverse: true
                    });

                }
            },
        });

    }

    $("#j_258").die("pagebeforeshow").live("pagebeforeshow", function(event, ui) {
        j_258_beforeshow();
    });

    if (runBeforeShow) {
        j_258_beforeshow();
    } else {
        j_258_onLoad();
    }

}

