var Helpers = {
	parseNewsDate: function(value){
        var date = value;
        var daten=date.split(" ",4);
		return daten[0]+" "+daten[1]+" "+daten[2]+" "+daten[3];
	},
	parseVideoDate: function(value){
        var vdate = value;
        var vdaten=vdate.split("T",1);
		return vdaten[0];
	},
	parseVideo: function(value){
        var vid = value;
        var video = vid.split("/").reverse()[0];
		return video;
	},
	parseYearLevel: function(value){
        var year = value;
        return "Year " + year;
	},
};

var file;
function fileSelectHandler(e) {
    var files = e.target.files || e.dataTransfer.files;
    file = files[0];
    $("#submitdiv").css('visibility','visible');
    $("#submitdiv2").css('visibility','visible');
    previewFile();
}

function upload() {
    var serverUrl = 'http://m.convention2013.amsa.org.au/app/upload.php?name=' + file.name;

    $.ajax({
        type: "POST",
        beforeSend: function(request) {
            request.setRequestHeader("Content-Type", file.type);
        },
        url: serverUrl,
        data: file,
        processData: false,
        contentType: false,
        success: function(data) {

            // OPTIONAL, this is the file name under which the image was stored in database....
            // localStorage.setItem('db_file_name', file.name);
            alert('Success');

         },
        error: function(data) {
            // do something in case of an error...
            alert('Error');
        }
    });
}

function previewFile() {

    var previewContainer = $('table[dsid=preview]');
    var fileName = $('[name=fileName]');
    // make the preview container visible once a file was selected
    previewContainer.toggle();

    // set the file name
    fileName.text(file.name);

    // display image in preview container
    if (file.type.indexOf("image") == 0) {
        var reader = new FileReader();
        reader.onload = function(e) {
            var image = $('[name=image]');
            image.attr('src', e.target.result);
            $('[class=mobileimage1_div]').show();
        }
        reader.readAsDataURL(file);
    }

}

